(453, 'options_home_slider_0_layer', '<div class=\"slide-content clearfix \">\r\n<h2 style=\"color: #ffffff;\">You Are In<span style=\"color: #ffffff;\"> Safe Hands</span></h2>\r\n<h4 style=\"color: #ffffff;\">Safe Hands Anesthesia &amp; Critical Care Services - Our Group By your Side</h4>\r\n</div>', 'no'),
(454, '_options_home_slider_0_layer', 'field_5acf2bc64c4a5', 'no'),
(455, 'options_home_slider', '4', 'no'),
(456, '_options_home_slider', 'field_5acf2b954c4a3', 'no'),
(457, 'options_welcome', '&nbsp;\r\n<h2>Welcome to SHACCS</h2>\r\nSafe Hands Anaesthesia and Critical Care Services (SHACCS) is a growing organization which has evolved from a core group of independent anaesthesiologists to a prominent, efficient and successful professional anaesthesia organization partnering with the top hospital systems and surgical centres. Provides state-of-the-art perioperative medicine at multiple locations throughout Bangalore areas. SHA comprises of over 25 certified registered Anaesthetists and Intensivists and is currently affiliated with 5 Hospitals.\r\n\r\nThe primary focus of our group practice is to effectively serve the needs of our hospital partners and patients, deliver safe, high quality, effective, efficient and equitable patient and family centered care. We have built a strong team that maintains its competitive edge in the present health care field and we have attained this by retaining qualified anaesthetists who share the vision of a compassionate, patient centered approach and high quality care.\r\n\r\nWe assure you that at Safe Hands Group you are in the safest hands and our goal is to ensure a healthy YOU.', 'no'),
(458, '_options_welcome', 'field_5acf2c614c4a6', 'no'),
(459, 'options_founder_text', '&nbsp;\r\n<h2>Founder</h2>\r\nDr. Nagesh is the founder of SHACCS and he being the rock pillar of this organization has extensive knowledge, expertise and the leadership to motivate the team in achieving family and patient centered care.\r\n\r\nRealizing that anaesthesia leadership is critical to a well-functioning operating suite we have the ability to drive change by impacting clinical and operational performance. Our goal is to bring about a holistic enhancement through constant improvement, effective communication, and compassionate care for a better treatment outcome facilitating a speedy recovery for our patients.', 'no'),
(460, '_options_founder_text', 'field_5acf2c884c4a7', 'no'),
(461, 'options_hospital_&_critical_care_services', '<p>The services include a wide range of anesthesia care, chronic &amp; acute pain management, resuscitation, intensive and critical care support provided in a hospital setup. Pre-Anesthetic assessment of the patient especially for complex surgeries before administering anesthesia is an integral part of our specialist practice. </p>', 'no'),
(462, '_options_hospital_&_critical_care_services', 'field_5acf2dda4c4a8', 'no'),
(463, 'options_pain_management', 'Acute and Chronic pain management services are provided in hospital and multi-specialty clinic setup. This help to provide pain relief to patients after surgery, injury or during illnesses including cancer.', 'no'),
(464, '_options_pain_management', 'field_5acf2df84c4a9', 'no'),
(465, 'options_emergency', 'Private hospitals often receive a number of calls on emergency especially during afterhours and group attends to these cases, stabilizes them and assists in operating immediately or at a later time.', 'no'),
(466, '_options_emergency', 'field_5acf2e104c4aa', 'no'),
(467, 'options_obstetrics', 'Obstetric analgesia and anesthesia services are provided by us. Advanced epidural and spinal pain relief techniques are used to meet the needs of woman in labor. Anesthesia both regional and general are provided for emergency and elective Caesarian section as well as for general obstetric procedures.', 'no'),
(468, '_options_obstetrics', 'field_5acf2e274c4ab', 'no'),
(469, 'options_home_slider_1_image', '200', 'no'),
(470, '_options_home_slider_1_image', 'field_5acf2bae4c4a4', 'no'),
(471, 'options_home_slider_1_layer', '<div class=\"slide-content right1 clearfix \">\r\n<h2 style=\"color: #30305a;\"><span style=\"color: #30305a;\">Care</span> When <span style=\"color: #30305a;\">You are Unaware</span></h2>\r\n</div>', 'no'),
(472, '_options_home_slider_1_layer', 'field_5acf2bc64c4a5', 'no'),
