(475, 'options_home_slider_2_layer', '<div class=\"slide-content left1 clearfix \">\r\n<h2 style=\"color: #ffffff;\">Passionate team coming together <span style=\"color: #ffffff;\">to serve better</span></h2>\r\n</div>', 'no'),
(476, '_options_home_slider_2_layer', 'field_5acf2bc64c4a5', 'no'),
(477, 'options_hospital_critical_care_services', 'The services include a wide range of anesthesia care, chronic &amp; acute pain management, resuscitation, intensive and critical care support provided in a hospital setup. Pre-Anesthetic assessment of the patient especially for complex surgeries before administering anesthesia is an integral part of our specialist practice.', 'no'),
