(805, 338, 'doctor_description', ' <p>Consultant Anesthesiologist & Intensive Medicine Specialist</p>\r\n     \r\n                       <p>M.B.B.S., D.N.B., FICM</p>\r\n\r\n                       \r\n     <p>Founder & Director of SHACCS</p>\r\n      \r\n                      <p>Dr. Nagesh is a Senior Consultant in Anesthesiology. His vast experience and knowledge in managing emergency conditions makes him one of the most sorted Anesthesiologists in Bangalore.</p>\r\n  \r\n                          <p>- Trained in difficult airway management and certified from TATA Memorial Hospital, Mumbai. </p>\r\n     \r\n                       <p>- Trained in Regional Anesthesia and USG guided Nerve Block from Ganga Hospital, Coimbotore.</p>\r\n        <p>- Extensive experience in Obstetric Emergencies, Obstetric Anesthesia and Critical Care.</p>\r\n        <p>- Leading practitioner in Thoracic Anesthesia in Bangalore.</p>'),
