(98, 1, '2018-03-29 12:13:49', '2018-03-29 12:13:49', '<div class=\"row\">\r\n<div class=\"col-lg-6 col-md-6 col-sm-12 text-center feature-icon\"><img class=\"alignnone wp-image-175 size-full\" src=\"http://localhost/urth/wp-content/uploads/2018/03/four.jpg\" alt=\"\" width=\"1920\" height=\"1080\" /></div>\r\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\r\n<div class=\"blog-page-single clearfix\"><article id=\"post-177\" class=\" clearfix post-177 page type-page status-publish hentry\">\r\n<div class=\"full-width-contents\">\r\n<div class=\"entry-content\">\r\n\r\nSHACCS is a leading organization in providing Anesthesia and Critical Care Services in and around Bangalore and offers an exciting career opportunity to the desirable candidates. You will have the exposure and opportunity to work your areas of interest like Gastrointestinal, Obstetrics, Urology, Cardiovascular, Neurosurgical, orthopedics etc. At SHACCS you will have a promising career growth and we encourage the team to continuously upgrade and improve their skills to be on par with the international standards. Team working spirit and flexibility is an aspired requirement from the recruits. The candidates are expected to present papers and posters at national and international seminars.\r\n\r\nYou can join us as â€“\r\n<ol>\r\n 	<li>Senior Consultant</li>\r\n 	<li>Junior Consultant</li>\r\n 	<li>Senior Resident</li>\r\n</ol>\r\n</div>\r\n</div>\r\n</article></div>\r\n</div>\r\n<div class=\"col-lg-12 col-md-12 col-sm-12\">\r\n<div class=\"blog-page-single clearfix\"><article id=\"post-177\" class=\" clearfix post-177 page type-page status-publish hentry\">\r\n<div class=\"full-width-contents\">\r\n<div class=\"entry-content\">\r\n\r\n<a href=\"http://shacks.com\">SHACCS</a> is hiring for the below positions. If you fit in any of these roles and would like to be a part of a growing organization that emphasizes on quality then please apply by emailing us your current, updated resume to <a href=\"mailto:jobs@shaccs.com\">jobs@shaccs.com</a>. You can also mail us your queries if any.\r\n<table style=\"width: 100%;\" border=\"1\" cellspacing=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"height: 17.4500pt; vertical-align: top; width: 63.9000pt;\">Date</td>\r\n<td style=\"height: 17.4500pt; vertical-align: top; width: 148.5000pt;\">Post</td>\r\n<td style=\"height: 17.4500pt; vertical-align: top; width: 120.5000pt;\">Qualification</td>\r\n<td style=\"height: 17.4500pt; vertical-align: top; width: 104.3500pt;\">Location</td>\r\n</tr>\r\n<tr>\r\n<td style=\"height: 8.5500pt; vertical-align: top; width: 63.9000pt;\">08/03/2018</td>\r\n<td style=\"height: 8.5500pt; vertical-align: top; width: 148.5000pt;\">Anesthesiologist</td>\r\n<td style=\"height: 8.5500pt; vertical-align: top; width: 120.5000pt;\">MBBS, MD/DNB/DA</td>\r\n<td style=\"height: 8.5500pt; vertical-align: top; width: 104.3500pt;\">Bangalore</td>\r\n</tr>\r\n<tr>\r\n<td style=\"height: 20.4000pt; vertical-align: top; width: 63.9000pt;\">08/03/2018</td>\r\n<td style=\"height: 20.4000pt; vertical-align: top; width: 148.5000pt;\">Intensivist</td>\r\n<td style=\"height: 20.4000pt; vertical-align: top; width: 120.5000pt;\">MBBS, MD/DNB/DA, FNB/IDCCM</td>\r\n<td style=\"height: 20.4000pt; vertical-align: top; width: 104.3500pt;\">Bangalore</td>\r\n</tr>\r\n<!--\r\n<tr>--> <!--\r\n<td style=\"height:26.4000pt; vertical-align:top; width:63.9000pt\">--> <!-- 08/03/2018 --> <!--</td>\r\n--> <!--\r\n<td style=\"height:26.4000pt; vertical-align:top; width:148.5000pt\">--> <!-- Anesthesia Technician --> <!--</td>\r\n--> <!--\r\n<td style=\"height:26.4000pt; vertical-align:top; width:120.5000pt\">--> <!-- MBBS, DNB/MD/DA --> <!--</td>\r\n--> <!--\r\n<td style=\"height:26.4000pt; vertical-align:top; width:104.3500pt\">--> <!-- Bangalore --> <!--</td>\r\n--> <!--</tr>\r\n--></tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</article></div>\r\n</div>\r\n<div class=\"clearfix\"></div>\r\n</div>', 'Carrers', '', 'publish', 'clos