(136, 1, '2018-03-30 08:53:56', '2018-03-30 08:53:56', '<p style=\"text-align: center;\">Consultant Anesthesiologist</p>\r\n<p style=\"text-align: center;\">M.B.B.S., M.D., DNB</p>\r\n<p style=\"text-align: center;\">Dr. Praveen Kumar has worked as Registrar in Anesthesiology and Cardiac ICU at Olympus Hospital, Rajkot and is currently working at SHACCS as a Consultant.</p>', 'Dr. Praveen Kumar. V.', '', 'publish', 'open', 'closed', '', 'dr-praveen-kumar-v', '', '', '2018-06-19 08:13:05', '2018-06-19 08:13:05', '', 0, 'http://localhost/urth/?post_type=acme_product&#038;p=142', 1, 'acme_product', '', 0),
(137, 1, '2018-03-30 08:55:58', '2018-03-30 08:55:58', '<p style=\"text-align: center;\">Consultant Anesthesiologist</p>\r\n<p style=\"text-align: center;\">M.B.B.S., M.D., DNB, FIPP</p>\r\n<p style=\"text-align: center;\">Dr. Raghavendra is an Interventional Pain Specialist</p>\r\n<p style=\"text-align: center;\">- Has done his diploma in palliative medicine</p>\r\n<p style=\"text-align: center;\">- Fellowship in Pain Services</p>\r\n<p style=\"text-align: center;\">- Fellow of Interventional Pain Practice</p>\r\n<p style=\"text-align: center;\">- Has worked as a Senior Consultant at various places</p>', 'Dr. Raghavendra', '', 'publish', 'open', 'closed', '', 'dr-raghavendra', '', '', '2018-06-19 08:03:14', '2018-06-19 08:03:14', '', 0, 'http://localhost/urth/?post_type=acme_product&#038;p=148', 7, 'acme_product', '', 0),
(140, 1, '2018-03-30 08:54:22', '2018-03-30 08:54:22', '<p style=\"text-align: center;\">Consultant Anesthesiologist</p>\r\n<p style=\"text-align: center;\">M.B.B.S., M.D.</p>\r\n<p style=\"text-align: center;\">Dr. Sudhir Rao has worked as Assistant Professor at MSRamaiha Care, Bangalore. Experienced in Critical Care services.</p>', 'Dr. Sudhir Rao. S.', '', 'publish', 'open', 'closed', '', 'dr-sudhir-rao-s', '', '', '2018-06-19 08:09:14', '2018-06-19 08:09:14', '', 0, 'http://localhost/urth/?post_type=acme_product&#038;p=143', 0, 'acme_product', '', 0),
(141, 1, '2018-03-30 08:53:37', '2018-03-30 08:53:37', '<p style=\"text-align: center;\">Consultant Anesthesiologist</p>\r\n<p style=\"text-align: center;\">MBBS, DA, DNB, FNB, FICC</p>\r\n<p style=\"text-align: center;\">Dr. Vasant is a Cardiac Anesthesia Specialist.</p>\r\n<p style=\"text-align: center;\">- Extensive experience in handling cardiac surgeries including adult and pediatric cases</p>\r\n<p style=\"text-align: center;\">- Instructor for ALS/ BLS course</p>\r\n<p style=\"text-align: center;\">- Has completed Fellowship in Cardiac Critical Care</p>\r\n<p style=\"text-align: center;\">- Especially skilled in TEE (intraoperative transesophageal echocardiography), obstetric, orthopedic and general surgical emergencies.</p>', 'Dr. Patil Vasant Prabhakar', '', 'publish', 'open', 'closed', '', 'dr-patil-vasant-prabhakar', '', '', '2018-05-04 13:07:18', '2018-05-04 13:07:18', '', 0, 'http://localhost/urth/?post_type=acme_product&#038;p=141', 11, 'acme_product', '', 0),
(142, 1, '2018-03-30 08:49:49', '2018-03-30 08:49:49', '<p style=\"text-align: center;\"></p>\r\n<p style=\"text-align: center;\">M.B.B.S., M.D.</p>\r\n<p style=\"text-align: center;\">Dr. Ashok has worked as Assistant Professor at MSR Care, Bangalore.</p>\r\n<p style=\"text-align: center;\">- Specialized in Regional Anesthesia and Labour Anesthesia</p>\r\n<p style=\"text-align: center;\">- Qualified in CTLS (Comprehensive Trauma Life Support)</p>\r\n<p style=\"text-align: center;\">- Instructor in American Heart Association- ACLS (Advanced Cardiac Life Support) course</p>\r\n<p style=\"text-align: center;\">- Fellowship in Regional Anesthesia</p>', 'Dr.Ashok.M.S.', '', 'publish', 'closed', 'closed', '', 'dr-ashok-m-s', '', '', '2018-06-19 07:52:03', '2018-06-19 07:52:03', '', 0, 'http://localhost/urth/?post_type=acme_product&#038;p=136', 4, 'acme_product', '', 0),
(143, 1, '2018-03-30 08:53:13', '2018-03-30 08:53:13', '<p style=\"text-align: center;\">Consultant Anesthesiologist</p>\r\n<p style=\"text-align: center;\">M.B.B.S.,M.D.,IDCCM</p>\r\n<p style=\"text-align: center;\">Dr. Mohseen is especially skilled in endotracheal intubation, nasal intubation, supraglottic airway device insertion, tracheostomies and intensive care service. He enjoys teaching key concepts of Anesthesiology and Critical Care medicine. Certified in BLS (Basic Life Support) and ALS (Advanced Life Support)</p>', 'Dr.Mohseen', '', 'publish', 'open', 'closed', '', 'dr-mohseen', '', '', '2018-06-19 07:51:20', '2018-06-19 07:51:20', '', 0, 'http://localhost/urth/?post_type=acme_product&#038;p=140', 3, 'acme_product', '', 0),
