(148, 1, '2018-03-30 08:50:14', '2018-03-30 08:50:14', '<p style=\"text-align: center;\">Consultant Anesthesiologist</p>\r\n<p style=\"text-align: center;\">M.B.B.S., M.D.</p>\r\n<p style=\"text-align: center;\">Dr. Sandhya has worked as an Assistant Professor at Kannur Medical College.</p>\r\n<p style=\"text-align: center;\">- Completed a Fellowship in ultrasound guided Regional Anesthesia</p>\r\n<p style=\"text-align: center;\">- Especially skilled in endotracheal and nasal intubation and supraglottic airway devices</p>\r\n<p style=\"text-align: center;\">- Experience is handling high risk cases, Obstetric cases and Paediatric cases</p>\r\n<p style=\"text-align: center;\">- ACLS trained</p>', 'Dr.Sandhya.M.K.', '', 'publish', 'closed', 'closed', '', 'dr-sandhya-m-k', '', '', '2018-06-19 07:52:22', '2018-06-19 07:52:22', '', 0, 'http://localhost/urth/?post_type=acme_product&#038;p=137', 5, 'acme_product', '', 0),
