(223, 1, '2018-03-30 10:36:22', '2018-03-30 10:36:22', '', 'Obstetrics', 'Obstetric analgesia and anesthesia services are provided by us. Advanced epidural and spinal pain relief techniques are used to meet the needs of woman in labor. Anesthesia both regional and general are provided for emergency and elective Caesarian section as well as for general obstetric procedures.', 'inherit', 'closed', 'closed', '', '222-revision-v1', '', '', '2018-03-30 10:36:22', '2018-03-30 10:36:22', '', 222, 'http://localhost/urth/222-revision-v1/', 0, 'revision', '', 0),
(224, 1, '2018-03-30 10:36:49', '2018-03-30 10:36:49', '<section class=\"single-feature clearfix col-lg-12 col-md-12 col-sm-12 \">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12 col-md-12 col-sm-12 text-center feature-icon\"><img src=\"../../wp-content/uploads/2014/05/3rd.png\" alt=\"\" /></div>\r\n<div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n<div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n<h3 class=\"text-center\">Critical Care Services</h3>\r\n&nbsp;\r\n<div class=\"col-sm-6 text-center\"><img class=\"alignnone size-full wp-image-192\" src=\"http://localhost/urth/wp-content/uploads/2018/03/shutterstock_168180668.jpg\" alt=\"\" width=\"1920\" height=\"1080\" />\r\n\r\n</div>\r\n<div class=\"col-sm-6\">\r\n\r\nCritical care service is provided to patients who are the risk of immediate life threatening conditions in which vital organs are involved. Goal is to maintain the vital organ system functioning and improve the patient\'s condition using advanced diagnostic and therapeutic technology.\r\n\r\n&nbsp;\r\n\r\nCritical care units are specially staffed, equipped and designed to closely monitor and treat patients with life-threatening conditions.Â Patients may need specialist treatment because one or more of their body systems, such as their heart, lung or kidneys, are not working properly. Critical Care monitoring includes hemodynamic, cardiac, pulse oximetry, and ventilator support.\r\n\r\n&nbsp;\r\n\r\n</div>\r\n<div class=\"col-sm-12\">\r\n\r\nSHA provides 24/7 critical and intensive care and bedside service at our partner hospitals for patients who are critically ill or in high dependency cases post a major surgery, high risk patients, patients will multi-organ failure and acutely ill patients. Service includes the provision of medical assessment and diagnosis, respiratory and cardiovascular support and infection control. The team has medical knowledge and technical expertise to deal with many emergency and trauma situations. They provide airway management, cardiac and pulmonary resuscitation, advanced life support and pain control.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"visible-lg clearfix\"></div>\r\n<div class=\"visible-md clearfix\"></div>', 'Critical Care Services', 'Critical care service is provided to patients who are the risk of immediate life threatening conditions in which vital organs are involved. Goal is to maintain the vital organ system functioning and improve the patient\'s condition using advanced diagnostic and therapeutic technology.', 'publish', 'open', 'open', '', 'critical-care-services', '', '', '2018-03-30 12:17:20', '2018-03-30 12:17:20', '', 0, 'http://localhost/urth/?p=224', 0, 'post', '', 0),
(225, 1, '2018-03-30 10:36:49', '2018-03-30 10:36:49', '', 'Critical Care Services', 'Critical care service is provided to patients who are the risk of immediate life threatening conditions in which vital organs are involved. Goal is to maintain the vital organ system functioning and improve the patient\'s condition using advanced diagnostic and therapeutic technology.', 'inherit', 'closed', 'closed', '', '224-revision-v1', '', '', '2018-03-30 10:36:49', '2018-03-30 10:36:49', '', 224, 'http://localhost/urth/224-revision-v1/', 0, 'revision', '', 0),
(226, 1, '2018-03-30 10:37:08', '2018-03-30 10:37:08', '<section class=\"single-feature clearfix col-lg-12 col-md-12 col-sm-12 \">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12 col-md-12 col-sm-12 text-center feature-icon\"><img src=\"../../wp-content/uploads/2014/05/3rd.png\" alt=\"\" /></div>\r\n<div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n<h3 class=\"text-center\">Pain Management</h3>\r\n&nbsp;\r\n<div class=\"col-sm-6 text-center\"><img class=\"alignnone size-full wp-image-191\" src=\"http://localhost/urth/wp-content/uploads/2018/03/seven.jpg\" alt=\"\" width=\"1920\" height=\"1080\" />\r\n\r\n</div>\r\n<div class=\"col-sm-6\">\r\n\r\nWhether you\'ve just had surgery or are dealing with a chronic medical condition or if you have acute pain, SHA helps you to manage these and helps you by not letting it be a daily struggle. We manage common back pain to pain related to cancer or other diseases and also acute pain following surgery. Specialists at SHA offer a compassionate environment and provide treatment plan based on the individual case that is best suited to the patient.\r\n\r\n&nbsp;\r\n\r\nThe effectiveness of pain treatments depends greatly on the strength of the Doctor-patient relationship. Pain treatment is never about the doctorâ€™s intervention alone, but about collaboration between the doctor, the patient, and the family.\r\n\r\n&nbsp;\r\n\r\n</div>\r\n<div class=\"col-sm-12\">\r\n\r\nIt involves treating all types of pain, including musculoskeletal, spinal and neuropathic pain disorders. With an accurate diagnosis and early intervention, we hope to help patients avoid spiralling into a state of chronic pain, or at least reduce the severity of pain, and improve patientsâ€™ quality of life. Minimally invasive procedures and proper use of medications are implemented to achieve those goals. This unique and focused combination of skills permits our experts to treat you, through a comprehensive non-surgical treatment plan that reduces or helps manage your pain andÂ <strong>improves your quality of life.</strong>\r\n\r\n&nbsp;\r\n\r\n</div>\r\n</div>\r\n<ol>\r\n 	<li><strong>Acute pain.</strong> Following surgery or other procedures, many people need short-term pain management. Injuries not requiring surgery may also cause significant pain that needs to be controlled. Treatments for acute pain may be as simple as a local anaesthetic or as complex as specialized procedures to minimize stress on the heart and blood pressure. Our anaesthesiologists work with you to decide the plan best suited for your individual needs so you can rest and begin healing.</li>\r\n 	<li><strong>Chronic pain.</strong> A growing number of people are coming forward for help with pain that affects them over long periods of time. Our anaesthesiologists work using a multidisciplinary, comprehensive approach to care for people with significant chronic pain. Our pain management anaesthesiologists are skilled in reducing pain while preserving spine and nerve function. We use a variety of techniques for managing pain, including:</li>\r\n</ol>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<h3>Treatment</h3>\r\n<ol>\r\n 	<li><strong>Basic Pain Treatment:</strong>\r\n<ul>\r\n 	<li><strong>Rest and diet changes</strong></li>\r\n 	<li><strong>Exercise and physical therapy</strong></li>\r\n 	<li><strong>Anti-inflammatory drugs (ex: ibuprofen)</strong></li>\r\n 	<li><strong>Cognitive and behavioral modification</strong></li>\r\n</ul>\r\n</li>\r\n 	<li><strong>Mid-Level Pain Treatment:</strong>\r\n<ul>\r\n 	<li><strong>Injections.</strong> Local anesthetics injected in or near nerves may reduce pain and inflammation in particular parts of the body.</li>\r\n 	<li><strong>Nerve blocks.</strong> We inject special medicines into large nerve clusters to reduce or eliminate pain in particular parts of the body.\r\n<ul class=\"pain\">\r\n 	<li><strong> &gt; Celiac Plexus Block- </strong>Local anesthetic is injected to cervical plexus near a group of nerves that stimulate the abdominal organs. This type of block is used most commonly to treat upper abdominal pain, which may be due to cancer or chronic pancreatitis. The procedure can lessen or eliminate your abdominal pain. It can also help your physician find the cause of your pain. This is known as a diagnostic nerve block</li>\r\n 	<li><strong> &gt; Epidural Steroid Injection- </strong>Small amount of steroid medication is injected near nerves in your lower back. The medication is injected into the epidural space, an area surrounding the spinal cord and nerves.Â  This helps to relieve pain in your neck, arms, legs, chest or lower back. An ESI also may be performed to relieve pain caused by shingles. This type of block helps to increase mobility by reducing inflammation and decreasing pain.</li>\r\n 	<li><strong> &gt; Facet Joint Block- </strong>Anesthetic is injected to the facet joint. Facet joints are located on the side of your spine, away from the spinal cord. A facet joint block relieves pain known to be related to the facet joints and is performed if your doctor suspects that your neck or lower back pain may be caused in part by the small facet joints of the spine.</li>\r\n 	<li><strong> &gt; Hypogastric Plexus Block- </strong>A Hypogastric plexus block involves placing an anesthetic near the region of the plexus and usually involves a series of injections repeated at weekly intervals. This treatment has brought relief for many patients who suffer from pelvic pain including pain of the bladder and lower intestines. It also treats pain of the uterus, ovaries, and vagina in women, and pain of the prostate and testicles in men.</li>\r\n 	<li><strong> &gt; Intercostal Nerve Block-</strong> Local anesthetic is injected in the area between two ribs. It is used to prevent painful impulses from reaching the brain. An intercostal nerve block is used to treat pain due to shingles, which is an acute viral infection that causes inflammation of the nerves that spread outward from the spine. It may also be performed to treat pain caused by surgical incisions in the chest area or to help determine the cause of your pain.</li>\r\n 	<li><strong> &gt; Lumbar Sympathetic Block- Lo</strong>cal anesthetic is injected around a group of nerves in your lower back (lumbar area). It is performed if you have reflex sympathetic dystrophy (RSD), a disease involving a disturbance of circulation to the skin that often leads to neuropathic pain (pain caused by a disorder of the nervous system).</li>\r\n 	<li><strong> &gt; Radiofrequency Ablation- </strong>Radiofrequency ablation uses an electrical current produced by a radiowave to heat up a small area of nerve tissue, thereby decreasing pain signals from that tissue. It is very effective and has a long lasting pain relief.</li>\r\n 	<li><strong> &gt; Spine CATH IDET Therapy- </strong>It is a minimally invasive treatment in which a physician applies controlled levels of heat to a broad section of the affected disc wall. The heat contracts and thickens the collagen of the disc wall and raises the temperature of the nerve endings. The therapy may result in contraction or closure of the disc wall fissures and a reduction in the bulge of the inner disc material and a desensitization of the pain sensors within the disc.</li>\r\n 	<li><strong> &gt; Stellate Ganglion Block- L</strong>ocal anesthetic is injected around stellate ganglion to relieve pain. The pain relief will affect one side of the head and neck, the upper arm and upper part of the chest on the same side of the body. The procedure may be performed on people who have circulation problems or the following nerve injuries â€“ reflex sympathetic dystrophy, excessive sweating in the palms or arm pits, causalgia, herpes zoster, or phantom limb pain.</li>\r\n 	<li><strong> &gt; Trigger Point Injections- S</strong>mall amounts of local anesthetic and steroids are injected in the area of the muscle where you have pain or tenderness. These areas are called trigger points because they produce pain when they are stimulated. TPIs are performed to relieve myofascial pain, which is pain in the specific muscle or muscle group.</li>\r\n 	<li><strong> &gt; Tunneled Epidural Catheter- </strong>A tunneled epidural catheter is a small catheter that is placed in the epidural space and tunneled under the skin. It provides a small dose of pain-killing medication and stays in place during a patient\'s rehabilitation.</li>\r\n 	<li><strong> &gt; Vertebroplasty- </strong>Percutaneous vertebroplasty is a procedure for the treatment and stabilization of vertebral compression fractures. A compression fracture of the vertebrae means the bone has collapsed or is crushed. Compression fractures are the result of bone that has been weakened, most commonly by osteoporosis and in rare cases, by cancers, benign tumors or trauma.</li>\r\n</ul>\r\n</li>\r\n 	<li><strong>Opioid medicines-</strong> These pills may reduce pain to manageable levels when taken as directed.</li>\r\n 	<li><strong>Electrical stimulation- </strong>We use a small, handheld device to stimulate nerves through the skin to reduce pain.</li>\r\n</ul>\r\n</li>\r\n 	<li><strong>Advanced Pain Treatment-</strong>\r\n<ul>\r\n 	<li>Spinal Cord Stimulation â€“ This technique uses electrical signals to mask the perception of pain traveling from the painful area to the brain. In place of pain, patients feel a mild tingling sensation called \"paresthesia.\" It may provide long-lasting pain relief and can be used with other therapies.</li>\r\n 	<li>Surgery- Surgical treatments may range from minor outpatient procedures to brain and spinal procedures. Surgery may be needed when structural problems occur within the spinal column often caused by injury or disease.</li>\r\n 	<li>Implantable drug pumps- Pumps deliver pain medication directly to the space surrounding the spinal cord. Direct application reduces the amount of opioids needed to relieve painful symptoms.</li>\r\n 	<li>Neuroablation- Often used as a last resort when other therapies fail, Neuroablation is a surgical technique that destroys nerves and tissue, permanently blocking nerve signals to the brain.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n&nbsp;\r\n<h4><strong>Side effects</strong></h4>\r\nAfter have general anaesthesia you may have side effects like pneumonia, heart problems, and vomiting.\r\n\r\nWith high doses of local anaesthetic, the effect might spread to the rest of the body affecting heart and the brain.\r\n\r\nWith spinal anaesthesia some people suffer with headaches.\r\n\r\nThe risk factor depends on your age, type of anaesthesia, your general health, and how you respond to the medicines used. If you have a pre-existing heart or lung disorder, your chances of problems from anaesthesia may be higher.\r\n\r\n</div>\r\n</section>\r\n<div class=\"visible-lg clearfix\"></div>\r\n<div class=\"visible-md clearfix\"></div>', 'Pain Management', 'Acute and Chronic pain management services are provided in hospital and multi-specialty clinic setup. This help to provide pain relief to patients after surgery, injury or during illnesses including cancer.', 'publish', 'open', 'open', '', 'pain-management', '', '', '2018-04-12 10:48:19', '2018-04-12 10:48:19', '', 0, 'http://localhost/urth/?p=226', 0, 'post', '', 0),
