(230, 1, '2018-03-30 11:31:30', '2018-03-30 11:31:30', 'form input[type=\"text\"], form input[type=\"email\"], form input[type=\"url\"], form input[type=\"tel\"], form input[type=\"number\"], form input[type=\"date\"], form input[type=\"range\"], form input[type=\"password\"], form input[type=\"text\"], form textarea {\n    width: 100%;\n    height: auto;\n    border: 0px solid #dcdee4 !important;\n    background-color: #505258 !important;\n    margin-bottom: 20px;\n    padding: 11px 10px;\n    color: #3a3c41;\n    font-weight: 500;\n}\n article.two-col-service.service.type-service.status-publish.has-post-thumbnail.hentry {\n       height: auto !important;\n        border-bottom: 1px solid #fff !important;\n    }\n    .pgap p {\n    margin-bottom: 5px !important;\n}\n   \n    .two-col-service1 {\n        background: #fff;\n        \n        margin-bottom: 15px;\n    }', 'urth', '', 'inherit', 'closed', 'closed', '', '125-revision-v1', '', '', '2018-03-30 11:31:30', '2018-03-30 11:31:30', '', 125, 'http://localhost/urth/125-revision-v1/', 0, 'revision', '', 0),
(231, 1, '2018-03-30 11:43:12', '2018-03-30 11:43:12', ' <section class=\"single-feature clearfix col-lg-12 col-md-12 col-sm-12 \">\r\n                        <div class=\"row\">\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12  text-center feature-icon\">\r\n                                <img src=\"../../wp-content/uploads/2014/05/3rd.png\" alt=\"\">\r\n                            </div>\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n                                 <p><b><h3 class=\"text-center\">Anaesthesia</h3></b><br>\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n                            <div class=\"col-sm-6 text-center\"><img src=\"images/anesthesia.jpg\"><br><br></div>\r\n                                <div class=\"col-sm-6\">\r\n                              <p> Anaesthesia refers to a state of no sensation and can be general, regional or local. General anaesthesia involves drugs which induce a deep sleep; regional anaesthesia (epidural / spinal) involves injecting drugs around the spine to numb the legs and abdomen; local anaesthesia involves injecting drugs into the skin to numb a small area. Sedation involves drugs that produce sleepiness or a light sleep but stop short of general anaesthesia.</p>\r\n\r\n<p>All of these techniques can be used alone or in combination depending on the specific procedure. The decision as to which is best for your situation will be made by your consultant anaesthetist after discussion with you.</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p><h5><b>Anaesthesia may be used to:</b></h5><br />\r\n&bull;&nbsp;&nbsp; &nbsp;Relax you.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Block pain.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Make you sleepy or forgetful.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Make you unconscious for your surgery.<br />\r\n</p><br>\r\n<p>\r\nThe Anaesthesiologist is a medical doctor specially trained in perioperative care. They will review your medical record and will meet with you to discuss your particular medical conditions to determine the impact they may have on your care. Will ask questions about the medications that you take. It is always a good idea to have a list of these medications with you. You will be asked about any reactions that you may have had in the past to anaesthesia. The Anaesthesiologist will perform a brief physical examination to make sure that there is no problem that may make your surgery/anaesthesia unsafe.</p>\r\n\r\n<p>Once the Anaesthesiologist has determined that your medical condition is satisfactory, will discuss the type of anaesthesia chosen that best suits your particular situation. The Anaesthesiologist may offer alternative anaesthetic techniques if appropriate. You will be described the particular advantages and disadvantages of each type of anaesthesia and will make sure you understand what is going to happen. If necessary, they will also discuss the reasons for the use of any special monitors that may be needed to ensure your safety during surgery. Your IV (intravenous catheter) will be placed either by the Anaesthesiologist and will be used to administer medications and fluids in the operating room.</p><br>\r\n\r\n<p><h5>Preoperative Sedation</h5><br /><p>\r\nBecause most people are nervous about their impending surgery and anaesthesia, the Anaesthesiologist may give you some medication to relax you before going into the operating room. This medication may or may not make you sleepy. If you are going to have any special monitors placed, the Anaesthesiologist may decide to give you additional sedation to make the placement of these monitors easier. Again, the type and amount of sedation that you get will be tailored to your needs and medical condition. In our same day surgery centres, you are unlikely to receive medication for relaxation as these medicines may linger and cause excessive sedation after surgery.&nbsp;</p>\r\n\r\n<p>You should feel free to ask any questions at this time. Although this plan will be the basic framework of your anaesthesia, there may be unexpected events during your surgery that may require us to deviate from this plan.&nbsp;</p>\r\n\r\n<p>Post-operative pain management- The management of pain after your surgery is important to us. Once again, based on your procedure, medical history, and other considerations, we may be able to offer some methods to better treat your postoperative pain.</p><br>\r\n</div>\r\n<br>\r\n<br>\r\n<div class=\"col-sm-12\">\r\n<p><h5><strong>Monitors</strong></h5><br />\r\n\r\n <div class=\"col-sm-6 text-left\"><img src=\"images/image001.jpg\"><br><br></div>\r\n<div class=\"col-sm-6\"><p>\r\nAfter arriving in the operating room, several monitors will be applied routinely during your procedure.</p>\r\n\r\n<p>They include:<br />\r\n<b>Anaesthesia WorkStation </b><br />\r\n<b>Depth monitor </b><br />\r\n<b>Ultrasound Machine </b><br />\r\n<b>Blood pressure cuff </b> - This will tell us your blood pressure throughout the case.<br />\r\n<b>Pulse oximeter </b> - This monitors your pulse and the amount of oxygen saturated in your blood.<br />\r\n<b>EKG monitor </b>- Monitors the electrical activity of your heart.</p>\r\n\r\n<p>Other monitors used to observe your status include:<br />\r\nHeart and lung sounds with a special stethoscope<br />\r\nYour body temperature<br />\r\nThe amount of oxygen and carbon dioxide you are breathing in and out and the amounts of medicines we are administering to you with the anaesthesia machine</p><br>\r\n</div>\r\n</div>\r\n \r\n <div class=\"col-sm-12\">\r\n<p><h3><b>Types of Anaesthesia</b></h3><br />\r\n<b><h4>Local Anaesthesia:</h4></b><br /><p>\r\nThis type of anaesthesia numbs a small part of the body for minor procedures. For example, you may get a shot of medicine directly into the surgical area to block pain. You may stay awake during the procedure.</p>\r\n\r\n<p><h5><b>Monitored Anaesthesia Care (MAC):</b></h5><br />\r\nMAC stands for Monitored Anaesthesia Care. Monitors to evaluate the heart (EKG), oxygenation (Pulse oximeter), and blood pressure are used. With this category of anaesthesia, patients can expect to receive sedation, which is usually with a variety of medications administered through an intravenous catheter. These medications are very effective for treating anxiety and pain. A sleepy state, also sometimes called twilight anaesthesia, is achieved before the start of the procedure. Breathing tubes are not required as patients continue to breathe without assistance. Supplemental oxygen is usually administered through a plastic face mask or nasal prongs. The medicines administered usually cause a state of amnesia so patients are unlikely to remember much of what happens in the operating room. Since this is not general anaesthesia, the patient may find that they can hear voices and experience some sensation. Surgeons often inject local anesthetics to numb the area they are operating on so that the patient will not experience any pain. The level of sedation can be adjusted to the patient&#39;s level of comfort.</p>\r\n\r\n<p><h5><b>Benefits</b></h5> - By using MAC anaesthesia, the patient can avoid the side effects of general anaesthesia. Patients are usually able to leave the recovery room and return home much sooner.</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p><h4><b>General Anaesthesia:</b></h4><br />\r\n<div class=\"col-sm-6 text-center\"><img src=\"images/ten.jpg\"><br><br></div>\r\n<div class=\"col-sm-6\"><p>\r\nThis type of anaesthesia involves a complete loss of consciousness. Monitors for the heart (EKG), oxygenation (Pulse oximeter), blood pressure, and temperature are used. Supplemental oxygen is given through a facemask. Medications are then given through an intravenous catheter to induce unconsciousness in the patient. After ensuring unconsciousness, a breathing tube is usually inserted in the mouth.</p>\r\n\r\n<p>There are two types of breathing tubes that can be used. For procedures that do not involve the muscle of respiration, and where muscle relaxation is not required, a laryngeal mask airway (LWA) is commonly used. This type of breathing tube rests in the throat and does not extend into the trachea (your windpipe). Usually, the patient breathes on his/her own, and a ventilator is not used. The second type of breathing tube is an endotracheal tube (ETT). This plastic tube is inserted into the throat past the vocal cords and into the trachea. A cuff is inflated to form a seal so that oxygen and anesthetic gases can be delivered with a ventilator.</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n\r\n<p>During the procedure, muscle relaxants may be used so the surgeon can gain better access to the operative site. Anaesthetic gases, as well as intravenous medications, may be administered throughout the procedure to keep the patient asleep and without pain.</p>\r\n\r\n<p>Upon awakening from general anaesthesia, the anaesthetic gases are turned off and the breathing tube is removed as soon as the patient is breathing on his/her own, and beings to respond appropriately. On rare occasions, or for very extensive procedures, the breathing tube may be left in place until certain criteria are met so that the breathing tube can be removed safely. This may occur in the post anaesthesia care unit (PACU), or one of the critical care units.</p>\r\n\r\n<p><h5><b>Benefits</b></h5> - General anaesthesia is sometimes the only option available for major operations. This option often provides the best operating conditions for the surgeon. The patient will be completely unconscious and unaware of anything happening in the operating room.</p>\r\n\r\n</div>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p><h4><b>Regional anaesthesia&nbsp;</b></h4><br />\r\n<div class=\"col-sm-6 text-center\"><img src=\"images/image002.png\"><br></div>\r\n<div class=\"col-sm-6\"><p>\r\nThis types of anaesthesia blocks pain to a larger part of your body. You may also get medicine to help you relax or sleep. Types of regional anaesthesia include:</p>\r\n\r\n<p><h4><b>1. Spinal and Epidural anesthesia-</b></h4> This is a shot of anaesthetic near the spinal cord and the nerves that connect to it. It blocks pain from an entire region of the body, such as the belly, hips, or legs.</p>\r\n\r\n<p><h5><b>Spinal Anaesthesia:</b></h5> After numbing the skin in the lower back, a very thin needle is inserted to deposit a small amount of local anaesthetic in the spinal canal to numb the nerves. The numbness usually lasts about two to four hours. The time period can vary from person to person and will also depend on how much and what kind of local anaesthetic is given. The patient will feel warmth or a pins and needles sensation in the legs as the nerves are blocked. Within a few minutes, there will be a loss of sensation to cold or sharp objects. Feelings of light touch and pressure may remain throughout the procedure, which is normal. The patient will be tested for loss of sensation to pain prior to starting the procedure.&nbsp;</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p><h5><b>Types of Procedures:</b></h5> Typically used for gynaecologic (e.g. hysterectomies) and urologic (e.g. prostate) surgeries, as well as surgeries of the lower extremities (e.g. knee surgery).</p>\r\n\r\n<p><h5><b>Benefits</b></h5> - Spinal anaesthesia works well in providing good pain control for surgery. Before the patient experiences severe pain, pain medications can be given as the block wears off. Very little local anaesthetic is given, so the patient can be wide awake or sedated. Pregnant patients will benefit, as there is minimal medication to interact with the foetus.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-sm-12\">\r\n    \r\n<p><h4><b>Epidural Anaesthesia:</b></h4><br>\r\n<div class=\"col-sm-6 text-center\"><img src=\"images/eleven.jpg\"><br><br></div>\r\n<div class=\"col-sm-6\"><p>\r\n This is very similar to spinal anaesthesia. The major difference is that a catheter is introduced through a needle in the low or mid back. The catheter can remain for several days, providing continuous delivery of local anaesthetics, which continue to numb the nerves and provide pain relief to the surgical area. The catheter does not penetrate the membrane covering the spinal canal, so the patient is not at risk for developing a spinal headache unless the membrane is accidentally punctured. Because a catheter is left in place, epidural anaesthesia, as opposed to spinal anaesthesia, is well suited for long procedures of the lower extremities or where postoperative pain control is desired. Epidural anaesthesia is commonly used for thoracic surgery, radical prostatectomy, and for obstetric patients in active labour.</p>\r\n\r\n\r\n</div>\r\n<div class=\"col-sm-12\">\r\n    <p><h5><b>Types of Procedures:</b></h5> Typically used for labour, caesareans (C-sections) and surgeries of the colon and gastrointestinal tract.</p>\r\n<p><h5><b>Benefits -</b></h5> By using epidural anaesthesia, the side effects of general anaesthesia can be avoided. Epidural anaesthesia is usually a very effective means of postoperative pain control.</p>\r\n\r\n<p><br />\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-sm-12\">\r\n\r\n<b><h4>2. Peripheral nerve blocks-</h4></b><br>\r\n<div class=\"col-sm-6 text-left\"><img src=\"images/image001.png\"><br><br></div>\r\n<div class=\"col-sm-6 text-left\"><p>\r\n This is a shot of anaesthetic to block pain around a specific nerve or group of nerves that provide sensation to the site where surgery is planned. Blocks are often used for procedures on the hands, arms, feet, legs, or face. Typical areas that are blocked include:</p>\r\n\r\n<p>Cervical plexus - Nerves in the neck can be numbed for carotid endartectomies to be performed under MAC anaesthesia&nbsp;</p>\r\n\r\n<p>Interscalene block - Nerves in the neck can be blocked to numb the shoulder and upper arm. A device called a nerve stimulator, which delivers electrical impulses to the nerves, is used to help ascertain when the needle is close to the nerve.&nbsp;</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p><h4><b>Alternative nerve block -</b></h4> There are many nerves in the vicinity that can all be blocked. The phrenic nerve innervates the diaphragm, which is the major muscle used for breathing. There are two phrenic nerves, so if one is blocked the other usually is sufficient, although the patient may feel as if he/she has to work a little harder to breathe. The eyelid may also droop and the pupil may be less reactive as nerves to the eye can also be blocked. Hoarseness may result if the recurrent laryngeal nerve is blocked since this nerve innervates the vocal cords. These side effects will diminish as the block wears off.</p>\r\n\r\n<p><h5><b>Axillary -</b></h5> Nerves in the armpit are blocked for surgery in the lower arm</p>\r\n\r\n<p><h5><b>Femoral/Sciatic -</b></h5> Nerves in the groin and buttocks are blocked to allow surgery in the knee and leg</p>\r\n\r\n<p><h5><b>Popliteal -</b></h5> Nerves behind the knee are blocked to allow surgery in the lower leg</p>\r\n\r\n<p><h5><b>Ankle -</b></h5> Nerves in the ankle are blocked to allow surgery in the foot</p>\r\n\r\n<p><h5><b>Benefits -</b></h5> Epidural anaesthesia provides good postoperative pain control. The block can last for many hours, so as sensation returns, the patient can take pain medications to control the pain before it becomes severe. Also, general anaesthesia is usually not required, so its side effects can be avoided.<br />\r\n&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n                            </div>\r\n                        </div>\r\n                    </section>', 'Obstetrics', 'Obstetric analgesia and anesthesia services are provided by us. Advanced epidural and spinal pain relief techniques are used to meet the needs of woman in labor. Anesthesia both regional and general are provided for emergency and elective Caesarian section as well as for general obstetric procedures.', 'inherit', 'closed', 'closed', '', '222-revision-v1', '', '', '2018-03-30 11:43:12', '2018-03-30 11:43:12', '', 222, 'http://localhost/urth/222-revision-v1/', 0, 'revision', '', 0),
(232, 1, '2018-03-30 12:08:21', '2018-03-30 12:08:21', ' <section class=\"single-feature clearfix col-lg-12 col-md-12 col-sm-12 \">\r\n                        <div class=\"row\">\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12  text-center feature-icon\">\r\n                                <img src=\"../../wp-content/uploads/2014/05/3rd.png\" alt=\"\">\r\n                            </div>\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n                                 <p><b><h3 class=\"text-center\">Anaesthesia</h3></b><br>\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n                            <div class=\"col-sm-6 text-center\"><img src=\"images/anesthesia.jpg\"><br><br></div>\r\n                                <div class=\"col-sm-6\">\r\n                              <p> Anaesthesia refers to a state of no sensation and can be general, regional or local. General anaesthesia involves drugs which induce a deep sleep; regional anaesthesia (epidural / spinal) involves injecting drugs around the spine to numb the legs and abdomen; local anaesthesia involves injecting drugs into the skin to numb a small area. Sedation involves drugs that produce sleepiness or a light sleep but stop short of general anaesthesia.</p>\r\n\r\n<p>All of these techniques can be used alone or in combination depending on the specific procedure. The decision as to which is best for your situation will be made by your consultant anaesthetist after discussion with you.</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p><h5><b>Anaesthesia may be used to:</b></h5><br />\r\n&bull;&nbsp;&nbsp; &nbsp;Relax you.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Block pain.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Make you sleepy or forgetful.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Make you unconscious for your surgery.<br />\r\n</p><br>\r\n<p>\r\nThe Anaesthesiologist is a medical doctor specially trained in perioperative care. They will review your medical record and will meet with you to discuss your particular medical conditions to determine the impact they may have on your care. Will ask questions about the medications that you take. It is always a good idea to have a list of these medications with you. You will be asked about any reactions that you may have had in the past to anaesthesia. The Anaesthesiologist will perform a brief physical examination to make sure that there is no problem that may make your surgery/anaesthesia unsafe.</p>\r\n\r\n<p>Once the Anaesthesiologist has determined that your medical condition is satisfactory, will discuss the type of anaesthesia chosen that best suits your particular situation. The Anaesthesiologist may offer alternative anaesthetic techniques if appropriate. You will be described the particular advantages and disadvantages of each type of anaesthesia and will make sure you understand what is going to happen. If necessary, they will also discuss the reasons for the use of any special monitors that may be needed to ensure your safety during surgery. Your IV (intravenous catheter) will be placed either by the Anaesthesiologist and will be used to administer medications and fluids in the operating room.</p><br>\r\n\r\n<p><h5>Preoperative Sedation</h5><br /><p>\r\nBecause most people are nervous about their impending surgery and anaesthesia, the Anaesthesiologist may give you some medication to relax you before going into the operating room. This medication may or may not make you sleepy. If you are going to have any special monitors placed, the Anaesthesiologist may decide to give you additional sedation to make the placement of these monitors easier. Again, the type and amount of sedation that you get will be tailored to your needs and medical condition. In our same day surgery centres, you are unlikely to receive medication for relaxation as these medicines may linger and cause excessive sedation after surgery.&nbsp;</p>\r\n\r\n<p>You should feel free to ask any questions at this time. Although this plan will be the basic framework of your anaesthesia, there may be unexpected events during your surgery that may require us to deviate from this plan.&nbsp;</p>\r\n\r\n<p>Post-operative pain management- The management of pain after your surgery is important to us. Once again, based on your procedure, medical history, and other considerations, we may be able to offer some methods to better treat your postoperative pain.</p><br>\r\n</div>\r\n<br>\r\n<br>\r\n<div class=\"col-sm-12\">\r\n<p><h5><strong>Monitors</strong></h5><br />\r\n\r\n <div class=\"col-sm-6 text-left\"><img src=\"images/image001.jpg\"><br><br></div>\r\n<div class=\"col-sm-6\"><p>\r\nAfter arriving in the operating room, several monitors will be applied routinely during your procedure.</p>\r\n\r\n<p>They include:<br />\r\n<b>Anaesthesia WorkStation </b><br />\r\n<b>Depth monitor </b><br />\r\n<b>Ultrasound Machine </b><br />\r\n<b>Blood pressure cuff </b> - This will tell us your blood pressure throughout the case.<br />\r\n<b>Pulse oximeter </b> - This monitors your pulse and the amount of oxygen saturated in your blood.<br />\r\n<b>EKG monitor </b>- Monitors the electrical activity of your heart.</p>\r\n\r\n<p>Other monitors used to observe your status include:<br />\r\nHeart and lung sounds with a special stethoscope<br />\r\nYour body temperature<br />\r\nThe amount of oxygen and carbon dioxide you are breathing in and out and the amounts of medicines we are administering to you with the anaesthesia machine</p><br>\r\n</div>\r\n</div>\r\n \r\n <div class=\"col-sm-12\">\r\n<p><h3><b>Types of Anaesthesia</b></h3><br />\r\n<b><h4>Local Anaesthesia:</h4></b><br /><p>\r\nThis type of anaesthesia numbs a small part of the body for minor procedures. For example, you may get a shot of medicine directly into the surgical area to block pain. You may stay awake during the procedure.</p>\r\n\r\n<p><h5><b>Monitored Anaesthesia Care (MAC):</b></h5><br />\r\nMAC stands for Monitored Anaesthesia Care. Monitors to evaluate the heart (EKG), oxygenation (Pulse oximeter), and blood pressure are used. With this category of anaesthesia, patients can expect to receive sedation, which is usually with a variety of medications administered through an intravenous catheter. These medications are very effective for treating anxiety and pain. A sleepy state, also sometimes called twilight anaesthesia, is achieved before the start of the procedure. Breathing tubes are not required as patients continue to breathe without assistance. Supplemental oxygen is usually administered through a plastic face mask or nasal prongs. The medicines administered usually cause a state of amnesia so patients are unlikely to remember much of what happens in the operating room. Since this is not general anaesthesia, the patient may find that they can hear voices and experience some sensation. Surgeons often inject local anesthetics to numb the area they are operating on so that the patient will not experience any pain. The level of sedation can be adjusted to the patient&#39;s level of comfort.</p>\r\n\r\n<p><h5><b>Benefits</b></h5> - By using MAC anaesthesia, the patient can avoid the side effects of general anaesthesia. Patients are usually able to leave the recovery room and return home much sooner.</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p><h4><b>General Anaesthesia:</b></h4><br />\r\n<div class=\"col-sm-6 text-center\"><img src=\"images/ten.jpg\"><br><br></div>\r\n<div class=\"col-sm-6\"><p>\r\nThis type of anaesthesia involves a complete loss of consciousness. Monitors for the heart (EKG), oxygenation (Pulse oximeter), blood pressure, and temperature are used. Supplemental oxygen is given through a facemask. Medications are then given through an intravenous catheter to induce unconsciousness in the patient. After ensuring unconsciousness, a breathing tube is usually inserted in the mouth.</p>\r\n\r\n<p>There are two types of breathing tubes that can be used. For procedures that do not involve the muscle of respiration, and where muscle relaxation is not required, a laryngeal mask airway (LWA) is commonly used. This type of breathing tube rests in the throat and does not extend into the trachea (your windpipe). Usually, the patient breathes on his/her own, and a ventilator is not used. The second type of breathing tube is an endotracheal tube (ETT). This plastic tube is inserted into the throat past the vocal cords and into the trachea. A cuff is inflated to form a seal so that oxygen and anesthetic gases can be delivered with a ventilator.</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n\r\n<p>During the procedure, muscle relaxants may be used so the surgeon can gain better access to the operative site. Anaesthetic gases, as well as intravenous medications, may be administered throughout the procedure to keep the patient asleep and without pain.</p>\r\n\r\n<p>Upon awakening from general anaesthesia, the anaesthetic gases are turned off and the breathing tube is removed as soon as the patient is breathing on his/her own, and beings to respond appropriately. On rare occasions, or for very extensive procedures, the breathing tube may be left in place until certain criteria are met so that the breathing tube can be removed safely. This may occur in the post anaesthesia care unit (PACU), or one of the critical care units.</p>\r\n\r\n<p><h5><b>Benefits</b></h5> - General anaesthesia is sometimes the only option available for major operations. This option often provides the best operating conditions for the surgeon. The patient will be completely unconscious and unaware of anything happening in the operating room.</p>\r\n\r\n</div>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p><h4><b>Regional anaesthesia&nbsp;</b></h4><br />\r\n<div class=\"col-sm-6 text-center\"><img src=\"images/image002.png\"><br></div>\r\n<div class=\"col-sm-6\"><p>\r\nThis types of anaesthesia blocks pain to a larger part of your body. You may also get medicine to help you relax or sleep. Types of regional anaesthesia include:</p>\r\n\r\n<p><h4><b>1. Spinal and Epidural anesthesia-</b></h4> This is a shot of anaesthetic near the spinal cord and the nerves that connect to it. It blocks pain from an entire region of the body, such as the belly, hips, or legs.</p>\r\n\r\n<p><h5><b>Spinal Anaesthesia:</b></h5> After numbing the skin in the lower back, a very thin needle is inserted to deposit a small amount of local anaesthetic in the spinal canal to numb the nerves. The numbness usually lasts about two to four hours. The time period can vary from person to person and will also depend on how much and what kind of local anaesthetic is given. The patient will feel warmth or a pins and needles sensation in the legs as the nerves are blocked. Within a few minutes, there will be a loss of sensation to cold or sharp objects. Feelings of light touch and pressure may remain throughout the procedure, which is normal. The patient will be tested for loss of sensation to pain prior to starting the procedure.&nbsp;</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p><h5><b>Types of Procedures:</b></h5> Typically used for gynaecologic (e.g. hysterectomies) and urologic (e.g. prostate) surgeries, as well as surgeries of the lower extremities (e.g. knee surgery).</p>\r\n\r\n<p><h5><b>Benefits</b></h5> - Spinal anaesthesia works well in providing good pain control for surgery. Before the patient experiences severe pain, pain medications can be given as the block wears off. Very little local anaesthetic is given, so the patient can be wide awake or sedated. Pregnant patients will benefit, as there is minimal medication to interact with the foetus.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-sm-12\">\r\n    \r\n<p><h4><b>Epidural Anaesthesia:</b></h4><br>\r\n<div class=\"col-sm-6 text-center\"><img src=\"images/eleven.jpg\"><br><br></div>\r\n<div class=\"col-sm-6\"><p>\r\n This is very similar to spinal anaesthesia. The major difference is that a catheter is introduced through a needle in the low or mid back. The catheter can remain for several days, providing continuous delivery of local anaesthetics, which continue to numb the nerves and provide pain relief to the surgical area. The catheter does not penetrate the membrane covering the spinal canal, so the patient is not at risk for developing a spinal headache unless the membrane is accidentally punctured. Because a catheter is left in place, epidural anaesthesia, as opposed to spinal anaesthesia, is well suited for long procedures of the lower extremities or where postoperative pain control is desired. Epidural anaesthesia is commonly used for thoracic surgery, radical prostatectomy, and for obstetric patients in active labour.</p>\r\n\r\n\r\n</div>\r\n<div class=\"col-sm-12\">\r\n    <p><h5><b>Types of Procedures:</b></h5> Typically used for labour, caesareans (C-sections) and surgeries of the colon and gastrointestinal tract.</p>\r\n<p><h5><b>Benefits -</b></h5> By using epidural anaesthesia, the side effects of general anaesthesia can be avoided. Epidural anaesthesia is usually a very effective means of postoperative pain control.</p>\r\n\r\n<p><br />\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-sm-12\">\r\n\r\n<b><h4>2. Peripheral nerve blocks-</h4></b><br>\r\n<div class=\"col-sm-6 text-left\"><img src=\"images/image001.png\"><br><br></div>\r\n<div class=\"col-sm-6 text-left\"><p>\r\n This is a shot of anaesthetic to block pain around a specific nerve or group of nerves that provide sensation to the site where surgery is planned. Blocks are often used for procedures on the hands, arms, feet, legs, or face. Typical areas that are blocked include:</p>\r\n\r\n<p>Cervical plexus - Nerves in the neck can be numbed for carotid endartectomies to be performed under MAC anaesthesia&nbsp;</p>\r\n\r\n<p>Interscalene block - Nerves in the neck can be blocked to numb the shoulder and upper arm. A device called a nerve stimulator, which delivers electrical impulses to the nerves, is used to help ascertain when the needle is close to the nerve.&nbsp;</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p><h4><b>Alternative nerve block -</b></h4> There are many nerves in the vicinity that can all be blocked. The phrenic nerve innervates the diaphragm, which is the major muscle used for breathing. There are two phrenic nerves, so if one is blocked the other usually is sufficient, although the patient may feel as if he/she has to work a little harder to breathe. The eyelid may also droop and the pupil may be less reactive as nerves to the eye can also be blocked. Hoarseness may result if the recurrent laryngeal nerve is blocked since this nerve innervates the vocal cords. These side effects will diminish as the block wears off.</p>\r\n\r\n<p><h5><b>Axillary -</b></h5> Nerves in the armpit are blocked for surgery in the lower arm</p>\r\n\r\n<p><h5><b>Femoral/Sciatic -</b></h5> Nerves in the groin and buttocks are blocked to allow surgery in the knee and leg</p>\r\n\r\n<p><h5><b>Popliteal -</b></h5> Nerves behind the knee are blocked to allow surgery in the lower leg</p>\r\n\r\n<p><h5><b>Ankle -</b></h5> Nerves in the ankle are blocked to allow surgery in the foot</p>\r\n\r\n<p><h5><b>Benefits -</b></h5> Epidural anaesthesia provides good postoperative pain control. The block can last for many hours, so as sensation returns, the patient can take pain medications to control the pain before it becomes severe. Also, general anaesthesia is usually not required, so its side effects can be avoided.<br />\r\n&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n                            </div>\r\n                        </div>\r\n                    </section>', 'Hospital Services', 'The services include a wide range of anesthesia care, chronic & acute pain management, resuscitation, intensive and critical care support provided in a hospital setup. Pre-Anesthetic assessment of the patient especially for complex surgeries before administering anesthesia is an integral part.', 'inherit', 'closed', 'closed', '', '218-revision-v1', '', '', '2018-03-30 12:08:21', '2018-03-30 12:08:21', '', 218, 'http://localhost/urth/218-revision-v1/', 0, 'revision', '', 0);
