(233, 1, '2018-03-30 12:09:44', '2018-03-30 12:09:44', '     <section class=\"single-feature clearfix col-lg-12 col-md-12 col-sm-12 \">\r\n                        <div class=\"row\">\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12  text-center feature-icon\">\r\n                                <img src=\"../../wp-content/uploads/2014/05/3rd.png\" alt=\"\">\r\n                            </div>\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n                                <b><h3 class=\"text-center\">Critical Care Services</h3></b><br>\r\n                            <div class=\"col-sm-6 text-center\"><img src=\"images/shutterstock_168180668.jpg\"><br><br></div>\r\n                                <div class=\"col-sm-6\">\r\n                             <p>Critical care service is provided to patients who are the risk of immediate life threatening conditions in which vital organs are involved. Goal is to maintain the vital organ system functioning and improve the patient&#39;s condition using advanced diagnostic and therapeutic technology.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Critical care units are specially staffed, equipped and designed to closely monitor and treat patients with life-threatening conditions.&nbsp;Patients may need specialist treatment because one or more of their body systems, such as their heart, lung or kidneys, are not working properly. Critical Care monitoring includes hemodynamic, cardiac, pulse oximetry, and ventilator support.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<p>SHA provides 24/7 critical and intensive care and bedside service at our partner hospitals for patients who are critically ill or in high dependency cases post a major surgery, high risk patients, patients will multi-organ failure and acutely ill patients. Service includes the provision of medical assessment and diagnosis, respiratory and cardiovascular support and infection control. The team has medical knowledge and technical expertise to deal with many emergency and trauma situations. They provide airway management, cardiac and pulmonary resuscitation, advanced life support and pain control.</p>\r\n</div>\r\n</div> \r\n</div>\r\n                            </div>\r\n                        </div>\r\n                    </section>\r\n                                        \r\n                                        <div class=\"visible-lg clearfix\"></div>\r\n                        <div class=\"visible-md clearfix\"></div>', 'Critical Care Services', 'Critical care service is provided to patients who are the risk of immediate life threatening conditions in which vital organs are involved. Goal is to maintain the vital organ system functioning and improve the patient\'s condition using advanced diagnostic and therapeutic technology.', 'inherit', 'closed', 'closed', '', '224-revision-v1', '', '', '2018-03-30 12:09:44', '2018-03-30 12:09:44', '', 224, 'http://localhost/urth/224-revision-v1/', 0, 'revision', '', 0),
(234, 1, '2018-03-30 12:10:24', '2018-03-30 12:10:24', '     <section class=\"single-feature clearfix col-lg-12 col-md-12 col-sm-12 \">\r\n                        <div class=\"row\">\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12  text-center feature-icon\">\r\n                                <img src=\"../../wp-content/uploads/2014/05/3rd.png\" alt=\"\">\r\n                            </div>\r\n                            <div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n                                <b><h3 class=\"text-center\">Pain Management</h3></b><br>\r\n                                 <div class=\"col-sm-6 text-center\"><img src=\"images/pain.jpg\"><br><br></div>\r\n                                 \r\n                                 <div class=\"col-sm-6\">\r\n                              <p>Whether you&#39;ve just had surgery or are dealing with a chronic medical condition or if you have acute pain, SHA helps you to manage these and helps you by not letting it be a daily struggle. We manage common back pain to pain related to cancer or other diseases and also acute pain following surgery. Specialists at SHA offer a compassionate environment and provide treatment plan based on the individual case that is best suited to the patient.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The effectiveness of pain treatments depends greatly on the strength of the Doctor-patient relationship. Pain treatment is never about the doctor&rsquo;s intervention alone, but about collaboration between the doctor, the patient, and the family.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\'col-sm-12\'>\r\n<p>It involves treating all types of pain, including musculoskeletal, spinal and neuropathic pain disorders. With an accurate diagnosis and early intervention, we hope to help patients avoid spiralling into a state of chronic pain, or at least reduce the severity of pain, and improve patients&rsquo; quality of life. Minimally invasive procedures and proper use of medications are implemented to achieve those goals. This unique and focused combination of skills permits our experts to treat you, through a comprehensive non-surgical treatment plan that reduces or helps manage your pain and&nbsp;<strong>improves your quality of life.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n<ol>\r\n    <li><strong>Acute pain.</strong> Following surgery or other procedures, many people need short-term pain management. Injuries not requiring surgery may also cause significant pain that needs to be controlled. Treatments for acute pain may be as simple as a local anaesthetic or as complex as specialized procedures to minimize stress on the heart and blood pressure. Our anaesthesiologists work with you to decide the plan best suited for your individual needs so you can rest and begin healing.</li>\r\n\r\n\r\n\r\n\r\n\r\n    <li><strong>Chronic pain.</strong> A growing number of people are coming forward for help with pain that affects them over long periods of time. Our anaesthesiologists work using a multidisciplinary, comprehensive approach to care for people with significant chronic pain. Our pain management anaesthesiologists are skilled in reducing pain while preserving spine and nerve function. We use a variety of techniques for managing pain, including:</li>\r\n</ol>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n<h3>Treatment</h3>\r\n\r\n\r\n<ol>\r\n    <li><strong>Basic Pain Treatment:</strong>\r\n\r\n\r\n<ul>\r\n\r\n<li><strong>Rest and diet changes</strong></li>\r\n\r\n<li><strong>Exercise and physical therapy</strong></li>\r\n\r\n<li><strong>Anti-inflammatory drugs (ex: ibuprofen)</strong></li>\r\n\r\n<li><strong>Cognitive and behavioral modification</strong></li>\r\n\r\n</ul>\r\n\r\n</li>\r\n    <li><strong>Mid-Level Pain Treatment:</strong>\r\n    \r\n    <ul>\r\n    <li><strong>Injections.</strong> Local anesthetics injected in or near nerves may reduce pain and inflammation in particular parts of the body.</li>\r\n    <li><strong>Nerve blocks.</strong> We inject special medicines into large nerve clusters to reduce or eliminate pain in particular parts of the body.\r\n    \r\n    <ul class=\"pain\">\r\n    <li><strong> > Celiac Plexus Block- </strong>Local anesthetic is injected to cervical plexus near a group of nerves that stimulate the abdominal organs. This type of block is used most commonly to treat upper abdominal pain, which may be due to cancer or chronic pancreatitis. The procedure can lessen or eliminate your abdominal pain. It can also help your physician find the cause of your pain. This is known as a diagnostic nerve block</li>\r\n    <li><strong> > Epidural Steroid Injection- </strong>Small amount of steroid medication is injected near nerves in your lower back. The medication is injected into the epidural space, an area surrounding the spinal cord and nerves.&nbsp; This helps to relieve pain in your neck, arms, legs, chest or lower back. An ESI also may be performed to relieve pain caused by shingles. This type of block helps to increase mobility by reducing inflammation and decreasing pain.</li>\r\n    <li><strong> > Facet Joint Block- </strong>Anesthetic is injected to the facet joint. Facet joints are located on the side of your spine, away from the spinal cord. A facet joint block relieves pain known to be related to the facet joints and is performed if your doctor suspects that your neck or lower back pain may be caused in part by the small facet joints of the spine.</li>\r\n    <li><strong> > Hypogastric Plexus Block- </strong>A Hypogastric plexus block involves placing an anesthetic near the region of the plexus and usually involves a series of injections repeated at weekly intervals. This treatment has brought relief for many patients who suffer from pelvic pain including pain of the bladder and lower intestines. It also treats pain of the uterus, ovaries, and vagina in women, and pain of the prostate and testicles in men.</li>\r\n    <li><strong> > Intercostal Nerve Block-</strong> Local anesthetic is injected in the area between two ribs. It is used to prevent painful impulses from reaching the brain. An intercostal nerve block is used to treat pain due to shingles, which is an acute viral infection that causes inflammation of the nerves that spread outward from the spine. It may also be performed to treat pain caused by surgical incisions in the chest area or to help determine the cause of your pain.</li>\r\n     <li><strong> > Lumbar Sympathetic Block- Lo</strong>cal anesthetic is injected around a group of nerves in your lower back (lumbar area). It is performed if you have reflex sympathetic dystrophy (RSD), a disease involving a disturbance of circulation to the skin that often leads to neuropathic pain (pain caused by a disorder of the nervous system).</li>\r\n    <li><strong> > Radiofrequency Ablation- </strong>Radiofrequency ablation uses an electrical current produced by a radiowave to heat up a small area of nerve tissue, thereby decreasing pain signals from that tissue. It is very effective and has a long lasting pain relief.</li>\r\n    <li><strong> > Spine CATH IDET Therapy- </strong>It is a minimally invasive treatment in which a physician applies controlled levels of heat to a broad section of the affected disc wall. The heat contracts and thickens the collagen of the disc wall and raises the temperature of the nerve endings. The therapy may result in contraction or closure of the disc wall fissures and a reduction in the bulge of the inner disc material and a desensitization of the pain sensors within the disc.</li>\r\n    <li><strong> > Stellate Ganglion Block- L</strong>ocal anesthetic is injected around stellate ganglion to relieve pain. The pain relief will affect one side of the head and neck, the upper arm and upper part of the chest on the same side of the body. The procedure may be performed on people who have circulation problems or the following nerve injuries &ndash; reflex sympathetic dystrophy, excessive sweating in the palms or arm pits, causalgia, herpes zoster, or phantom limb pain.</li>\r\n    <li><strong> > Trigger Point Injections- S</strong>mall amounts of local anesthetic and steroids are injected in the area of the muscle where you have pain or tenderness. These areas are called trigger points because they produce pain when they are stimulated. TPIs are performed to relieve myofascial pain, which is pain in the specific muscle or muscle group.</li>\r\n    <li><strong> > Tunneled Epidural Catheter- </strong>A tunneled epidural catheter is a small catheter that is placed in the epidural space and tunneled under the skin. It provides a small dose of pain-killing medication and stays in place during a patient&#39;s rehabilitation.</li>\r\n    <li><strong> > Vertebroplasty- </strong>Percutaneous vertebroplasty is a procedure for the treatment and stabilization of vertebral compression fractures. A compression fracture of the vertebrae means the bone has collapsed or is crushed. Compression fractures are the result of bone that has been weakened, most commonly by osteoporosis and in rare cases, by cancers, benign tumors or trauma.</li>\r\n</ul>\r\n    \r\n    </li>\r\n    <li><strong>Opioid medicines-</strong> These pills may reduce pain to manageable levels when taken as directed.</li>\r\n    <li><strong>Electrical stimulation- </strong>We use a small, handheld device to stimulate nerves through the skin to reduce pain.</li>\r\n</ul>\r\n    </li>\r\n <li><strong>Advanced Pain Treatment-</strong>\r\n <ul>\r\n   \r\n    <li>Spinal Cord Stimulation &ndash; This technique uses electrical signals to mask the perception of pain traveling from the painful area to the brain. In place of pain, patients feel a mild tingling sensation called &quot;paresthesia.&quot; It may provide long-lasting pain relief and can be used with other therapies.</li>\r\n    <li>Surgery- Surgical treatments may range from minor outpatient procedures to brain and spinal procedures. Surgery may be needed when structural problems occur within the spinal column often caused by injury or disease.</li>\r\n    <li>Implantable drug pumps- Pumps deliver pain medication directly to the space surrounding the spinal cord. Direct application reduces the amount of opioids needed to relieve painful symptoms.</li>\r\n    <li>Neuroablation- Often used as a last resort when other therapies fail, Neuroablation is a surgical technique that destroys nerves and tissue, permanently blocking nerve signals to the brain.</li>\r\n</ul>\r\n </li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n\r\n<h4><strong>Side effects</strong></h4>\r\n\r\n<p>After have general anaesthesia you may have side effects like pneumonia, heart problems, and vomiting.</p>\r\n\r\n<p>With high doses of local anaesthetic, the effect might spread to the rest of the body affecting heart and the brain.</p>\r\n\r\n<p>With spinal anaesthesia some people suffer with headaches.</p>\r\n\r\n<p>The risk factor depends on your age, type of anaesthesia, your general health, and how you respond to the medicines used. If you have a pre-existing heart or lung disorder, your chances of problems from anaesthesia may be higher.&nbsp;</p>\r\n\r\n\r\n                            </div>\r\n                        </div>\r\n                    </section>\r\n                                        \r\n                                        <div class=\"visible-lg clearfix\"></div>\r\n                        <div class=\"visible-md clearfix\"></div>', 'Pain Management', 'Acute and Chronic pain management services are provided in hospital and multi-specialty clinic setup. This help to provide pain relief to patients after surgery, injury or during illnesses including cancer.', 'inherit', 'closed', 'closed', '', '226-revision-v1', '', '', '2018-03-30 12:10:24', '2018-03-30 12:10:24', '', 226, 'http://localhost/urth/226-revision-v1/', 0, 'revision', '', 0),
(235, 1, '2018-03-30 12:11:50', '2018-03-30 12:11:50', '<section class=\"single-feature clearfix col-lg-12 col-md-12 col-sm-12 \">\n<div class=\"row\">\n<div class=\"col-lg-12 col-md-12 col-sm-12 text-center feature-icon\"><img src=\"../../wp-content/uploads/2014/05/3rd.png\" alt=\"\" /></div>\n<div class=\"col-lg-12 col-md-12 col-sm-12 \">\n\n&nbsp;\n<h3 class=\"text-center\">Anaesthesia</h3>\n&nbsp;\n<div class=\"col-lg-12 col-md-12 col-sm-12 \">\n<div class=\"col-sm-6 text-center\"><img class=\"alignnone size-medium wp-image-193\" src=\"http://localhost/urth/wp-content/uploads/2018/03/shutterstock_292766960-300x169.jpg\" alt=\"\" width=\"300\" height=\"169\" />\n\n</div>\n<div class=\"col-sm-6\">\n\nAnaesthesia refers to a state of no sensation and can be general, regional or local. General anaesthesia involves drugs which induce a deep sleep; regional anaesthesia (epidural / spinal) involves injecting drugs around the spine to numb the legs and abdomen; local anaesthesia involves injecting drugs into the skin to numb a small area. Sedation involves drugs that produce sleepiness or a light sleep but stop short of general anaesthesia.\n\nAll of these techniques can be used alone or in combination depending on the specific procedure. The decision as to which is best for your situation will be made by your consultant anaesthetist after discussion with you.\n\n</div>\n<div class=\"col-sm-12\">\n<h5><b>Anaesthesia may be used to:</b></h5>\nâ€¢Â Â  Â Relax you.\nâ€¢Â Â  Â Block pain.\nâ€¢Â Â  Â Make you sleepy or forgetful.\nâ€¢Â Â  Â Make you unconscious for your surgery.\n\n&nbsp;\n\nThe Anaesthesiologist is a medical doctor specially trained in perioperative care. They will review your medical record and will meet with you to discuss your particular medical conditions to determine the impact they may have on your care. Will ask questions about the medications that you take. It is always a good idea to have a list of these medications with you. You will be asked about any reactions that you may have had in the past to anaesthesia. The Anaesthesiologist will perform a brief physical examination to make sure that there is no problem that may make your surgery/anaesthesia unsafe.\n\nOnce the Anaesthesiologist has determined that your medical condition is satisfactory, will discuss the type of anaesthesia chosen that best suits your particular situation. The Anaesthesiologist may offer alternative anaesthetic techniques if appropriate. You will be described the particular advantages and disadvantages of each type of anaesthesia and will make sure you understand what is going to happen. If necessary, they will also discuss the reasons for the use of any special monitors that may be needed to ensure your safety during surgery. Your IV (intravenous catheter) will be placed either by the Anaesthesiologist and will be used to administer medications and fluids in the operating room.\n\n&nbsp;\n<h5>Preoperative Sedation</h5>\n&nbsp;\n\nBecause most people are nervous about their impending surgery and anaesthesia, the Anaesthesiologist may give you some medication to relax you before going into the operating room. This medication may or may not make you sleepy. If you are going to have any special monitors placed, the Anaesthesiologist may decide to give you additional sedation to make the placement of these monitors easier. Again, the type and amount of sedation that you get will be tailored to your needs and medical condition. In our same day surgery centres, you are unlikely to receive medication for relaxation as these medicines may linger and cause excessive sedation after surgery.\n\nYou should feel free to ask any questions at this time. Although this plan will be the basic framework of your anaesthesia, there may be unexpected events during your surgery that may require us to deviate from this plan.\n\nPost-operative pain management- The management of pain after your surgery is important to us. Once again, based on your procedure, medical history, and other considerations, we may be able to offer some methods to better treat your postoperative pain.\n\n&nbsp;\n\n</div>\n&nbsp;\n<div class=\"col-sm-12\">\n<h5><strong>Monitors</strong></h5>\n&nbsp;\n<div class=\"col-sm-6 text-left\"><img class=\"alignnone size-medium wp-image-179\" src=\"http://localhost/urth/wp-content/uploads/2018/03/image001-300x203.jpg\" alt=\"\" width=\"300\" height=\"203\" />\n\n</div>\n<div class=\"col-sm-6\">\n\nAfter arriving in the operating room, several monitors will be applied routinely during your procedure.\n\nThey include:\n<b>Anaesthesia WorkStation </b>\n<b>Depth monitor </b>\n<b>Ultrasound Machine </b>\n<b>Blood pressure cuff </b> - This will tell us your blood pressure throughout the case.\n<b>Pulse oximeter </b> - This monitors your pulse and the amount of oxygen saturated in your blood.\n<b>EKG monitor </b>- Monitors the electrical activity of your heart.\n\nOther monitors used to observe your status include:\nHeart and lung sounds with a special stethoscope\nYour body temperature\nThe amount of oxygen and carbon dioxide you are breathing in and out and the amounts of medicines we are administering to you with the anaesthesia machine\n\n&nbsp;\n\n</div>\n</div>\n<div class=\"col-sm-12\">\n<h3><b>Types of Anaesthesia</b></h3>\n&nbsp;\n<h4>Local Anaesthesia:</h4>\n&nbsp;\n\nThis type of anaesthesia numbs a small part of the body for minor procedures. For example, you may get a shot of medicine directly into the surgical area to block pain. You may stay awake during the procedure.\n<h5><b>Monitored Anaesthesia Care (MAC):</b></h5>\nMAC stands for Monitored Anaesthesia Care. Monitors to evaluate the heart (EKG), oxygenation (Pulse oximeter), and blood pressure are used. With this category of anaesthesia, patients can expect to receive sedation, which is usually with a variety of medications administered through an intravenous catheter. These medications are very effective for treating anxiety and pain. A sleepy state, also sometimes called twilight anaesthesia, is achieved before the start of the procedure. Breathing tubes are not required as patients continue to breathe without assistance. Supplemental oxygen is usually administered through a plastic face mask or nasal prongs. The medicines administered usually cause a state of amnesia so patients are unlikely to remember much of what happens in the operating room. Since this is not general anaesthesia, the patient may find that they can hear voices and experience some sensation. Surgeons often inject local anesthetics to numb the area they are operating on so that the patient will not experience any pain. The level of sedation can be adjusted to the patient\'s level of comfort.\n<h5><b>Benefits</b></h5>\n- By using MAC anaesthesia, the patient can avoid the side effects of general anaesthesia. Patients are usually able to leave the recovery room and return home much sooner.\n\n</div>\n<div class=\"col-sm-12\">\n<h4><b>General Anaesthesia:</b></h4>\n&nbsp;\n<div class=\"col-sm-6 text-center\"><img src=\"images/ten.jpg\" />\n\n</div>\n<div class=\"col-sm-6\">\n\nThis type of anaesthesia involves a complete loss of consciousness. Monitors for the heart (EKG), oxygenation (Pulse oximeter), blood pressure, and temperature are used. Supplemental oxygen is given through a facemask. Medications are then given through an intravenous catheter to induce unconsciousness in the patient. After ensuring unconsciousness, a breathing tube is usually inserted in the mouth.\n\nThere are two types of breathing tubes that can be used. For procedures that do not involve the muscle of respiration, and where muscle relaxation is not required, a laryngeal mask airway (LWA) is commonly used. This type of breathing tube rests in the throat and does not extend into the trachea (your windpipe). Usually, the patient breathes on his/her own, and a ventilator is not used. The second type of breathing tube is an endotracheal tube (ETT). This plastic tube is inserted into the throat past the vocal cords and into the trachea. A cuff is inflated to form a seal so that oxygen and anesthetic gases can be delivered with a ventilator.\n\n</div>\n<div class=\"col-sm-12\">\n\nDuring the procedure, muscle relaxants may be used so the surgeon can gain better access to the operative site. Anaesthetic gases, as well as intravenous medications, may be administered throughout the procedure to keep the patient asleep and without pain.\n\nUpon awakening from general anaesthesia, the anaesthetic gases are turned off and the breathing tube is removed as soon as the patient is breathing on his/her own, and beings to respond appropriately. On rare occasions, or for very extensive procedures, the breathing tube may be left in place until certain criteria are met so that the breathing tube can be removed safely. This may occur in the post anaesthesia care unit (PACU), or one of the critical care units.\n<h5><b>Benefits</b></h5>\n- General anaesthesia is sometimes the only option available for major operations. This option often provides the best operating conditions for the surgeon. The patient will be completely unconscious and unaware of anything happening in the operating room.\n\n</div>\n</div>\n<div class=\"col-sm-12\">\n<h4><b>Regional anaesthesiaÂ </b></h4>\n&nbsp;\n<div class=\"col-sm-6 text-center\"><img src=\"images/image002.png\" /></div>\n<div class=\"col-sm-6\">\n\nThis types of anaesthesia blocks pain to a larger part of your body. You may also get medicine to help you relax or sleep. Types of regional anaesthesia include:\n<h4><b>1. Spinal and Epidural anesthesia-</b></h4>\nThis is a shot of anaesthetic near the spinal cord and the nerves that connect to it. It blocks pain from an entire region of the body, such as the belly, hips, or legs.\n<h5><b>Spinal Anaesthesia:</b></h5>\nAfter numbing the skin in the lower back, a very thin needle is inserted to deposit a small amount of local anaesthetic in the spinal canal to numb the nerves. The numbness usually lasts about two to four hours. The time period can vary from person to person and will also depend on how much and what kind of local anaesthetic is given. The patient will feel warmth or a pins and needles sensation in the legs as the nerves are blocked. Within a few minutes, there will be a loss of sensation to cold or sharp objects. Feelings of light touch and pressure may remain throughout the procedure, which is normal. The patient will be tested for loss of sensation to pain prior to starting the procedure.\n\n</div>\n<div class=\"col-sm-12\">\n<h5><b>Types of Procedures:</b></h5>\nTypically used for gynaecologic (e.g. hysterectomies) and urologic (e.g. prostate) surgeries, as well as surgeries of the lower extremities (e.g. knee surgery).\n<h5><b>Benefits</b></h5>\n- Spinal anaesthesia works well in providing good pain control for surgery. Before the patient experiences severe pain, pain medications can be given as the block wears off. Very little local anaesthetic is given, so the patient can be wide awake or sedated. Pregnant patients will benefit, as there is minimal medication to interact with the foetus.\n\n</div>\n</div>\n<div class=\"col-sm-12\">\n<h4><b>Epidural Anaesthesia:</b></h4>\n&nbsp;\n<div class=\"col-sm-6 text-center\"><img src=\"images/eleven.jpg\" />\n\n</div>\n<div class=\"col-sm-6\">\n\nThis is very similar to spinal anaesthesia. The major difference is that a catheter is introduced through a needle in the low or mid back. The catheter can remain for several days, providing continuous delivery of local anaesthetics, which continue to numb the nerves and provide pain relief to the surgical area. The catheter does not penetrate the membrane covering the spinal canal, so the patient is not at risk for developing a spinal headache unless the membrane is accidentally punctured. Because a catheter is left in place, epidural anaesthesia, as opposed to spinal anaesthesia, is well suited for long procedures of the lower extremities or where postoperative pain control is desired. Epidural anaesthesia is commonly used for thoracic surgery, radical prostatectomy, and for obstetric patients in active labour.\n\n</div>\n<div class=\"col-sm-12\">\n<h5><b>Types of Procedures:</b></h5>\nTypically used for labour, caesareans (C-sections) and surgeries of the colon and gastrointestinal tract.\n<h5><b>Benefits -</b></h5>\nBy using epidural anaesthesia, the side effects of general anaesthesia can be avoided. Epidural anaesthesia is usually a very effective means of postoperative pain control.\n\n&nbsp;\n\n</div>\n</div>\n<div class=\"col-sm-12\">\n\n&nbsp;\n<h4>2. Peripheral nerve blocks-</h4>\n&nbsp;\n<div class=\"col-sm-6 text-left\"><img src=\"images/image001.png\" />\n\n</div>\n<div class=\"col-sm-6 text-left\">\n\nThis is a shot of anaesthetic to block pain around a specific nerve or group of nerves that provide sensation to the site where surgery is planned. Blocks are often used for procedures on the hands, arms, feet, legs, or face. Typical areas that are blocked include:\n\nCervical plexus - Nerves in the neck can be numbed for carotid endartectomies to be performed under MAC anaesthesia\n\nInterscalene block - Nerves in the neck can be blocked to numb the shoulder and upper arm. A device called a nerve stimulator, which delivers electrical impulses to the nerves, is used to help ascertain when the needle is close to the nerve.\n\n</div>\n<div class=\"col-sm-12\">\n<h4><b>Alternative nerve block -</b></h4>\nThere are many nerves in the vicinity that can all be blocked. The phrenic nerve innervates the diaphragm, which is the major muscle used for breathing. There are two phrenic nerves, so if one is blocked the other usually is sufficient, although the patient may feel as if he/she has to work a little harder to breathe. The eyelid may also droop and the pupil may be less reactive as nerves to the eye can also be blocked. Hoarseness may result if the recurrent laryngeal nerve is blocked since this nerve innervates the vocal cords. These side effects will diminish as the block wears off.\n<h5><b>Axillary -</b></h5>\nNerves in the armpit are blocked for surgery in the lower arm\n<h5><b>Femoral/Sciatic -</b></h5>\nNerves in the groin and buttocks are blocked to allow surgery in the knee and leg\n<h5><b>Popliteal -</b></h5>\nNerves behind the knee are blocked to allow surgery in the lower leg\n<h5><b>Ankle -</b></h5>\nNerves in the ankle are blocked to allow surgery in the foot\n<h5><b>Benefits -</b></h5>\nEpidural anaesthesia provides good postoperative pain control. The block can last for many hours, so as sensation returns, the patient can take pain medications to control the pain before it becomes severe. Also, general anaesthesia is usually not required, so its side effects can be avoided.\n</div>\n</div>\n</div>\n</div>\n</div>\n</section>', 'Obstetrics', 'Obstetric analgesia and anesthesia services are provided by us. Advanced epidural and spinal pain relief techniques are used to meet the needs of woman in labor. Anesthesia both regional and general are provided for emergency and elective Caesarian section as well as for general obstetric procedures.', 'inherit', 'closed', 'closed', '', '222-autosave-v1', '', '', '2018-03-30 12:11:50', '2018-03-30 12:11:50', '', 222, 'http://localhost/urth/222-autosave-v1/', 0, 'revision', '', 0),
