(245, 1, '2018-03-30 12:31:05', '2018-03-30 12:31:05', 'Zion hospitals is a super-specialty hospital which aims at creating an integrated health care system by leveraging the best medical practices. It is a 75 bed hospital committed towards complete care.\r\n\r\nServices provided include 24/7 Anesthesia and Critical care services, Pain management, Perioperative care , Emergency resuscitation services at Casuality and wards , Labour Analgesia , and Anesthesia for Imaging procedures', 'Zion Hospitals', '', 'publish', 'open', 'closed', '', 'zion-hospitals', '', '', '2018-05-04 13:21:00', '2018-05-04 13:21:00', '', 0, 'http://localhost/urth/?post_type=affilate&#038;p=245', 0, 'affilate', '', 0),
(246, 1, '2018-03-30 12:31:51', '2018-03-30 12:31:51', '<p>Bangalore Orthopaedic and Surgical Hospital has a long history of providing high quality care &amp; clinical excellence. It is a 30 bed hospital located in North Bangalore. It offers a wide range of specialty services and is known for its clinical excellence.</p>\r\n<p>Services provided include 24/7 Anesthesia and Critical care services, Pain management, Perioperative care , Emergency resuscitation services at Casuality and wards , Labour Analgesia , and Anesthesia for Imaging procedures  </p>', 'BOSH', '', 'publish', 'open', 'closed', '', 'bosh', '', '', '2018-04-02 05:31:58', '2018-04-02 05:31:58', '', 0, 'http://localhost/urth/?post_type=affilate&#038;p=246', 0, 'affilate', '', 0),
(247, 1, '2018-03-30 12:32:34', '2018-03-30 12:32:34', 'Frontline is a MultispecialityÂ Hospital, an initiative of IMA (Monetary Advisory Council) and is committed towards providing highest quality medical care.\r\n\r\nIt is a 50 bedded hospital. Services provided include 24/7 Anesthesia and Critical care services, Pain management, Perioperative care , Emergency resuscitation services at Casuality and wards , Labour Analgesia , and Anesthesia for Imaging procedures', 'Frontline Multispecialty Hospital', '', 'publish', 'open', 'closed', '', 'frontline-multispecialty-hospital', '', '', '2018-05-04 13:24:20', '2018-05-04 13:24:20', '', 0, 'http://localhost/urth/?post_type=affilate&#038;p=247', 0, 'affilate', '', 0),
