(257, 1, '2018-05-04 13:09:15', '2018-05-04 13:09:15', '<div class=\"row\">\n<div class=\"col-lg-6 col-md-6 col-sm-12 text-center feature-icon\"><img class=\"alignnone wp-image-175 size-full\" src=\"http://localhost/urth/wp-content/uploads/2018/03/four.jpg\" alt=\"\" width=\"1920\" height=\"1080\" /></div>\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"blog-page-single clearfix\"><article id=\"post-177\" class=\" clearfix post-177 page type-page status-publish hentry\">\n<div class=\"full-width-contents\">\n<div class=\"entry-content\">\n\nSHACCS is a leading organization in providing Anesthesia and Critical Care Services in and around Bangalore and offers an exciting career opportunity to the desirable candidates. You will have the exposure and opportunity to work your areas of interest like Gastrointestinal, Obstetrics, Urology, Cardiovascular, Neurosurgical, orthopedics etc. At SHACCS you will have a promising career growth and we encourage the team to continuously upgrade and improve their skills to be on par with the international standards. Team working spirit and flexibility is an aspired requirement from the recruits. The candidates are expected to present papers and posters at national and international seminars.\n\nYou can join us as â€“\n<ol>\n 	<li>Senior Consultant</li>\n 	<li>Junior Consultant</li>\n 	<li>Senior Resident</li>\n</ol>\n</div>\n</div>\n</article></div>\n</div>\n<div class=\"col-lg-12 col-md-12 col-sm-12\">\n<div class=\"blog-page-single clearfix\"><article id=\"post-177\" class=\" clearfix post-177 page type-page status-publish hentry\">\n<div class=\"full-width-contents\">\n<div class=\"entry-content\">\n\n<a href=\"http://shacks.com\">SHACCS</a> is hiring for the below positions. If you fit in any of these roles and would like to be a part of a growing organization that emphasizes on quality then please apply by emailing us your current, updated resume to <a href=\"mailto:jobs@shaccs.com\">jobs@shaccs.com</a>. You can also m