(266, 1, '2018-04-02 08:19:33', '2018-04-02 08:19:33', '<div class=\"row\"><section class=\"single-feature clearfix col-lg-12 col-md-12 col-sm-12 \">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6 col-md-6 col-sm-12 text-center feature-icon\"><img class=\"alignnone size-full wp-image-196\" src=\"http://localhost/urth/wp-content/uploads/2018/03/six.jpg\" alt=\"\" width=\"1920\" height=\"1080\" /></div>\r\n<div class=\"col-lg-6 col-md-6 col-sm-12 \">\r\n\r\nOur extensive professional staff is comprised of over 15 certified Anaesthesiologists and Intensivists who are skilled, experienced and compassionate practitioners in the field of anaesthesiology. Focus on providing every patient the comfort and safety to ensure the patient has a pleasant experience. Comprehensive anaesthesia care is provided to patients who are undergoing a wide range of medical and surgical procedures. We work closely with surgeons and health facilities to manage the patientâ€™s post-operative pain and care.\r\nSHACCS team consists of specialists in handling cardiac, obstetric, pediatric and complex surgical cases and are trained in Advanced Life Support, Trauma Care and Cardiac Critical Care.Following basic medical graduation our physicians have gone through specialized anesthesia training and are extensively involved in teaching at reputed colleges. Through communication and education we aim towards providing quality patient care and ensure that the most appropriate decisions have been made towards your care.\r\n\r\n</div>\r\n<div class=\"col-lg-12 col-md-12 col-sm-12 \">\r\n\r\n&nbsp;\r\n\r\nAnaesthetic service includes a full pre-operative assessment, peri-operative and post-operative care. SHACCS provides critical care and pain management services. High dependency intensive care is available when required. We also provide an acute pain service for the duration of your in-hospital stay. Teamwork and over 40 years combined breadth of specialist experience means that you will be in the safest of hands at all times through what many be considered to be the most daunting prospect of a medical procedure â€“ the Anaesthesia. We value excellence, integrity, teamwork, respect, responsibility and adaptability.\r\n\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"visible-lg clearfix\"></div>\r\n<div class=\"visible-md clearfix\"></div>\r\n</div>', 'About Us', '', 'inherit', 'closed', 'closed', '', '90-revision-v1', '', '', '2018-04-02 08:19:33', '2018-04-02 08:19:33', '', 90, 'http://growthsoftware.net/shaccs/90-revision-v1/', 0, 'revision', '', 0),
