(361, 1, '2018-06-19 16:05:30', '2018-06-19 16:05:30', 'Female patient named Parvathy, age 45 yrs, suffering from hyperthyroidism for a long time presented for right Hemithyroidectomy. She was administered Superficial and Deep Cervical Plexus Block with Dexmed for the surgical procedure.\r\n\r\nThyroidectomy is traditionally performed under General Anaesthesia, however, Cervical Plexus Block has been found to be useful in doing this procedure. Very few centres have the expertise to perform this procedure meticulously.\r\n\r\nCervical plexus has a complex anatomy and is considered as a plexus of loops. The Cervical Plexus Block provides anaesthesia and analgesia to the head and neck region. It is often described as deep and superficial cervical plexus. The deep plexus provides the muscular branches and the superficial plexus provides the innervation of the skin of the head and neck.\r\n\r\nIndications:\r\n<ul>\r\n 	<li>Carotid Endarterectomy</li>\r\n 	<li>Lymph Node dissections and plastic repairs in the Neck region</li>\r\n 	<li>Shoulder Surgery</li>\r\n 	<li>Tracheostomy</li>\r\n 	<li>Thyroidectomy and Parathyroidectomy</li>\r\n</ul>\r\nDepending on the type of surgery, the plexus can be blocked either at a superficial or a deep level or both.\r\n\r\nSuperficial cervical plexus block:\r\n<ul>\r\n 	<li>The superficial branches of the plexus innervate the skin and superficial structures of the head, neck, and shoulder.</li>\r\n 	<li>It consists of a subcutaneous injection of local anaesthetic just under the skin. The landmark is posterior border of the Sternocleidomastoid muscle (SCM) in the Neck.</li>\r\n 	<li>The mid-point of the SCM is marked and from this point local anaesthetic is infiltrated subcutaneously along the superior and inferior border.</li>\r\n 	<li>Around 7-10 ml is injected along the entire muscle border using ultrasound guidance which avoids too deep needle insertion and ensures spread of the local anaesthetic in the correct plane.</li>\r\n</ul>\r\nDeep cervical plexus block:\r\n<ul>\r\n 	<li>The deep branches innervate the muscles of the deep anterior neck and the diaphragm.</li>\r\n 	<li>Deep cervical plexus block is a complex regional technique. This technique involves blocking the nerve roots of C2, C3 and C4. The roots of cervical nerves 1 to 7 emerge superior to the transverse process of each cervical vertebra.</li>\r\n 	<li>Using a 22G, 1.5 inch needle, the transverse processes are located by entering perpendicular to the skin. Depth of the transverse process varies from body habitus of the patient (1.5 to 3.0 cm deep)</li>\r\n 	<li>Once bone is contacted, the needle is pulled back slightly and redirected in the cephalic direction. This is repeated until the needle is walked off the bone.</li>\r\n 	<li>After careful aspiration of blood and/ or CSF, 5 ml of local anaesthetic is injected slowly. This is repeated at the other two transverse processes.</li>\r\n 	<li>During the injection, the patient should be communicated continuously to help detect any change in mental status that could occur due to the intravascular injection</li>\r\n</ul>', 'Cervical Plexus Block', '', 'publish', 'closed', 'closed', '', 'cervical-plexus-block', '', '', '2018-06-19 17:16:32', '2018-06-19 17:16:32', '', 0, 'http://shaccs.com/?post_type=home_blog&#038;p=361', 0, 'home_blog', '', 0),
