(1, 1523526729, 1523526729, 'new', 'knownfile', 1, '0504c3310259b8116ed6e0b7cf6891df', 'ddf22f2156cc0a7728bcd4494c6d54ba', 'WordPress core file modified: wp-admin/includes/misc.php', 'This WordPress core file has been modified and differs from the original file distributed with this version of WordPress.', 'a:6:{s:4:\"file\";s:26:\"wp-admin/includes/misc.php\";s:5:\"cType\";s:4:\"core\";s:7:\"canDiff\";b:1;s:6:\"canFix\";b:1;s:9:\"canDelete\";b:0;s:10:\"haveIssues\";s:4:\"core\";}'),
(2, 1523526745, 1523526745, 'new', 'easyPassword', 1, 'c4ca4238a0b923820dcc509a6f75849b', 'e3b000636fb86b32f2b3ef5c132c1139', 'User \"admin\" with \"administrator\" access has an easy password.', 'A user with the a role of \'administrator\' has a password that is easy to guess. Please change this password yourself or ask the user to change it.', 'a:6:{s:2:\"ID\";i:1;s:10:\"user_login\";s:5:\"admin\";s:10:\"user_email\";s:28:\"lokenath.choudhury@gmail.com\";s:10:\"first_name\";s:0:\"\";s:9:\"last_name\";s:0:\"\";s:12:\"editUserLink\";s:65:\"http://growthsoftware.net/shaccs/wp-admin/user-edit.php?user_id=1\";}'),
(3, 1523526752, 1523526752, 'new', 'wfPluginUpgrade', 2, '539cd7bd8fc3df04f17e10fd86cc86da', '539cd7bd8fc3df04f17e10fd86cc86da', 'The Plugin \"Akismet Anti-Spam\" needs an upgrade (4.0.2 -> 4.0.3).', 'You need to upgrade \"Akismet Anti-Spam\" to the newest version to ensure you have any security fixes the developer has released.', 'a:16:{s:4:\"Name\";s:17:\"Akismet Anti-Spam\";s:9:\"PluginURI\";s:20:\"https://akismet.com/\";s:7:\"Version\";s:5:\"4.0.2\";s:11:\"Description\";s:363:\"Used by millions, Akismet is quite possibly the best way in the world to <strong>protect your blog from spam</strong>. It keeps your site protected even while you sleep. To get started: activate the Akismet plugin and then go to your Akismet Settings page to set up your API key. <cite>By <a href=\"https://automattic.com/wordpress-plugins/\">Automattic</a>.</cite>\";s:6:\"Author\";s:66:\"<a href=\"https://automattic.com/wordpress-plugins/\">Automattic</a>\";s:9:\"AuthorURI\";s:41:\"https://automattic.com/wordpress-plugins/\";s:10:\"TextDomain\";s:7:\"akismet\";s:10:\"DomainPath\";s:0:\"\";s:7:\"Network\";b:0;s:5:\"Title\";s:52:\"<a href=\"https://akismet.com/\">Akismet Anti-Spam</a>\";s:10:\"AuthorName\";s:10:\"Automattic\";s:10:\"pluginFile\";s:72:\"/home/growthso/public_html/shaccs/wp-content/plugins/akismet/akismet.php\";s:10:\"newVersion\";s:5:\"4.0.3\";s:4:\"slug\";s:7:\"akismet\";s:5:\"wpURL\";s:37:\"https://wordpress.org/plugins/akismet\";s:10:\"vulnerable\";b:0;}'),
(4, 1523526752, 1523526752, 'new', 'wfPluginUpgrade', 2, 'c4c3df74eb719c93497e98d7ebe7cef3', 'c4c3df74eb719c93497e98d7ebe7cef3', 'The Plugin \"Customify\" needs an upgrade (1.5.7 -> 1.6.0.1).', 'You need to upgrade \"Customify\" to the newest version to ensure you have any security fixes the developer has released.', 'a:16:{s:4:\"Name\";s:9:\"Customify\";s:9:\"PluginURI\";s:40:\"https://wordpress.org/plugins/customify/\";s:7:\"Version\";s:5:\"1.5.7\";s:11:\"Description\";s:91:\"A Theme Customizer Booster <cite>By <a href=\"https://pixelgrade.com\">Pixelgrade</a>.</cite>\";s:6:\"Author\";s:47:\"<a href=\"https://pixelgrade.com\">Pixelgrade</a>\";s:9:\"AuthorURI\";s:22:\"https://pixelgrade.com\";s:10:\"TextDomain\";s:9:\"customify\";s:10:\"DomainPath\";s:11:\"/languages/\";s:7:\"Network\";b:0;s:5:\"Title\";s:64:\"<a href=\"https://wordpress.org/plugins/customify/\">Customify</a>\";s:10:\"AuthorName\";s:10:\"Pixelgrade\";s:10:\"pluginFile\";s:76:\"/home/growthso/public_html/shaccs/wp-content/plugins/customify/customify.php\";s:10:\"newVersion\";s:7:\"1.6.0.1\";s:4:\"slug\";s:9:\"customify\";s:5:\"wpURL\";s:39:\"https://wordpress.org/plugins/customify\";s:10:\"vulnerable\";b:0;}'),
(5, 1523526752, 1523526752, 'new', 'wfThemeUpgrade', 2, '275ed34646f0f6e9c7e92af889d898a5', '275ed34646f0f6e9c7e92af889d898a5', 'The Theme \"Twenty Seventeen\" needs an upgrade (1.4 -> 1.5).', 'You need to upgrade \"Twenty Seventeen\" to the newest version to ensure you have any security fixes the developer has released.', 'a:7:{s:10:\"newVersion\";s:3:\"1.5\";s:7:\"package\";s:61:\"https://downloads.wordpress.org/theme/twentyseventeen.1.5.zip\";s:3:\"URL\";s:45:\"https://wordpress.org/themes/twentyseventeen/\";s:4:\"Name\";s:16:\"Twenty Seventeen\";s:4:\"name\";s:16:\"Twenty Seventeen\";s:7:\"version\";s:3:\"1.4\";s:10:\"vulnerable\";b:0;}');
